-- TOC entry 726 (class 1255 OID 114738)
-- Name: add_rating(bigint, numeric, text); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.add_rating(p_order_id bigint, p_rating numeric, p_comment text DEFAULT NULL::text) RETURNS void
    LANGUAGE plpgsql
    AS $$
DECLARE
    client_id UUID;
    fourmiz_id UUID;
BEGIN
    -- Vérifier que l'order existe
    IF NOT EXISTS (SELECT 1 FROM orders WHERE id = p_order_id) THEN
        RAISE EXCEPTION 'Order % n''existe pas', p_order_id;
    END IF;
    
    -- Vérifier que le rating est valide (entre 1 et 5)
    IF p_rating < 1 OR p_rating > 5 THEN
        RAISE EXCEPTION 'Rating doit être entre 1 et 5, reçu: %', p_rating;
    END IF;
    
    -- Insérer le rating
    INSERT INTO ratings (order_id, rating, comment, created_at)
    VALUES (p_order_id, p_rating, p_comment, NOW());
    
    -- Récupérer les IDs client et fourmiz
    SELECT o.client_id, o.fourmiz_id 
    INTO client_id, fourmiz_id
    FROM orders o 
    WHERE o.id = p_order_id;
    
    -- Recalculer pour le client
    IF client_id IS NOT NULL THEN
        PERFORM update_user_rating(client_id);
    END IF;
    
    -- Recalculer pour le fourmiz
    IF fourmiz_id IS NOT NULL THEN
        PERFORM update_user_rating(fourmiz_id);
    END IF;
    
    RAISE NOTICE 'Rating ajouté pour order % et utilisateurs mis à jour', p_order_id;
END;
$$;


