CREATE FUNCTION public.add_real_rating(p_order_id bigint, p_rating numeric, p_comment text) RETURNS void
    LANGUAGE plpgsql
    AS $$
DECLARE
    v_client_id UUID;
    v_fourmiz_id UUID;
BEGIN
    -- Récupérer les IDs client et fourmiz
    SELECT client_id, fourmiz_id INTO v_client_id, v_fourmiz_id
    FROM orders WHERE id = p_order_id;
    
    -- Insérer le vrai rating
    INSERT INTO ratings (order_id, rating, comment, created_at)
    VALUES (p_order_id, p_rating, p_comment, NOW());
    
    -- Marquer les utilisateurs comme ayant un vrai rating (CORRIGÉ)
    UPDATE profiles 
    SET client_has_real_rating = TRUE 
    WHERE user_id = v_client_id;
    
    UPDATE profiles 
    SET fourmiz_has_real_rating = TRUE 
    WHERE user_id = v_fourmiz_id;
    
END;
$$;


