-- TOC entry 652 (class 1255 OID 160258)
-- Name: archive_completed_tracking(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.archive_completed_tracking() RETURNS integer
    LANGUAGE plpgsql
    AS $$
DECLARE
  archived_count INTEGER := 0;
BEGIN
  -- Archiver les trackings terminés depuis plus de 24h
  INSERT INTO service_tracking_history (
    id, service_id, fourmiz_user_id, client_user_id, service_type,
    total_distance_km, 
    total_duration_minutes,
    route_points_summary,
    started_at, ended_at
  )
  SELECT 
    id, service_id, fourmiz_user_id, client_user_id, service_type,
    total_distance_km,
    EXTRACT(EPOCH FROM (actual_end_at - started_at))::INTEGER / 60,
    jsonb_build_object(
      'start_point', route_points->0,
      'end_point', route_points->-1,
      'total_points', jsonb_array_length(route_points)
    ),
    started_at, actual_end_at
  FROM active_service_tracking
  WHERE status IN ('completed', 'cancelled')
    AND actual_end_at < CURRENT_TIMESTAMP - INTERVAL '24 hours';
  
  GET DIAGNOSTICS archived_count = ROW_COUNT;
  
  -- Supprimer les trackings archivés
  DELETE FROM active_service_tracking
  WHERE status IN ('completed', 'cancelled')
    AND actual_end_at < CURRENT_TIMESTAMP - INTERVAL '24 hours';
  
  RETURN archived_count;
END;
$$;


--
-- TOC entry 697 (class 1255 OID 147706)
-- Name: are_legal_engagements_required(uuid); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.are_legal_engagements_required(p_user_id uuid) RETURNS boolean
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
    profile_record RECORD;
BEGIN
    SELECT legal_engagements_required, grandfathered_fourmiz, profile_completed, roles
    INTO profile_record
    FROM public.profiles 
    WHERE user_id = p_user_id;
    
    -- Si pas de profil, engagements requis
    IF NOT FOUND THEN
        RETURN true;
    END IF;
    
    -- Si grandfathered, pas d'engagements requis
    IF profile_record.grandfathered_fourmiz = true THEN
        RETURN false;
    END IF;
    
    -- Pour les nouveaux profils Fourmiz, engagements requis (syntaxe text[])
    IF 'fourmiz' = ANY(profile_record.roles) THEN
        RETURN true;
    END IF;
    
    -- Par défaut, pas requis pour les clients
    RETURN false;
END;
$$;


--
-- TOC entry 735 (class 1255 OID 123287)
-- Name: audit_profile_counters(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.audit_profile_counters() RETURNS TABLE(user_id uuid, firstname text, lastname text, stored_orders_placed integer, real_orders_placed bigint, orders_diff integer, stored_missions_completed integer, real_missions_completed bigint, missions_diff integer)
    LANGUAGE plpgsql
    AS $$
BEGIN
  RETURN QUERY
  SELECT 
    p.user_id,
    p.firstname,
    p.lastname,
    p.orders_placed,
    COALESCE(client_counts.orders_count, 0) as real_orders_placed,
    (p.orders_placed - COALESCE(client_counts.orders_count, 0))::integer as orders_diff,
    p.missions_completed,
    COALESCE(fourmiz_counts.missions_count, 0) as real_missions_completed,
    (p.missions_completed - COALESCE(fourmiz_counts.missions_count, 0))::integer as missions_diff
  FROM profiles p
  LEFT JOIN (
    SELECT client_id, COUNT(*) as orders_count
    FROM orders 
    WHERE client_id IS NOT NULL
    GROUP BY client_id
  ) client_counts ON p.user_id = client_counts.client_id
  LEFT JOIN (
    SELECT fourmiz_id, COUNT(*) as missions_count
    FROM orders 
    WHERE fourmiz_id IS NOT NULL AND status = 'terminee'
    GROUP BY fourmiz_id
  ) fourmiz_counts ON p.user_id = fourmiz_counts.fourmiz_id
  WHERE p.orders_placed > 0 OR p.missions_completed > 0
     OR client_counts.orders_count > 0 OR fourmiz_counts.missions_count > 0
  ORDER BY ABS(orders_diff) + ABS(missions_diff) DESC;
END;
$$;


--
-- TOC entry 715 (class 1255 OID 169840)
-- Name: auto_cancel_expired_orders(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.auto_cancel_expired_orders() RETURNS TABLE(cancelled_order_id bigint, total_cancelled integer)
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
    expired_order RECORD;
    cancelled_count INTEGER := 0;
BEGIN
    -- Parcourir les commandes expirées
    FOR expired_order IN
        SELECT 
            o.id,
            o.client_id,
            o.service_title,
            o.date,
            o.start_time,
            o.created_at
        FROM orders o
        WHERE 
            o.status = 'en_attente'
            AND (
                -- Service prévu dans le passé
                (o.date + COALESCE(o.start_time, '09:00:00'::time)) < NOW()
                -- Grace period de 30 minutes après création
                AND o.created_at < NOW() - INTERVAL '30 minutes'
            )
    LOOP
        -- Annuler la commande
        UPDATE orders 
        SET 
            status = 'annulee',
            cancelled_at = NOW(),
            cancelled_by = expired_order.client_id,
            updated_at = NOW(),
            cancellation_reason = 'auto_cancel_expired'
        WHERE id = expired_order.id;
        
        cancelled_count := cancelled_count + 1;
        cancelled_order_id := expired_order.id;
        total_cancelled := cancelled_count;
        
        -- Log chaque annulation
        INSERT INTO system_logs (action, details, order_id, created_at)
        VALUES (
            'auto_cancel_expired',
            format('Auto-cancelled order %s for client %s (service was %s at %s)', 
                   expired_order.id, 
                   expired_order.client_id,
                   expired_order.date,
                   COALESCE(expired_order.start_time::text, '09:00:00')),
            expired_order.id,
            NOW()
        );
        
        RETURN NEXT;
        
    END LOOP;
    
    -- Log récapitulatif
    INSERT INTO system_logs (action, details, created_at)
    VALUES (
        'auto_cancel_summary', 
        format('Auto-cancellation run completed: %s orders cancelled', cancelled_count),
        NOW()
    );
    
    -- Retourner un résumé si aucune commande annulée
    IF cancelled_count = 0 THEN
        cancelled_order_id := 0;
        total_cancelled := 0;
        RETURN NEXT;
    END IF;
    
END;
$$;


--
-- TOC entry 594 (class 1255 OID 30234)
-- Name: broadcast_admin_notification_by_role(text, text, text); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.broadcast_admin_notification_by_role(title text, message text, role_filter text DEFAULT 'all'::text) RETURNS void
    LANGUAGE plpgsql
    AS $$
declare
  u record;
  current_email text;
begin
  -- ✅ Vérifie que l'utilisateur est connecté
  if auth.uid() is null then
    raise exception 'Accès refusé : utilisateur non authentifié.';
  end if;

  -- ✅ Vérifie que l'utilisateur est bien l'admin
  select email into current_email from auth.users where id = auth.uid();
  if current_email is null or current_email != 'admin@fourmiz.com' then
    raise exception 'Accès réservé à l''administrateur.';
  end if;

  -- 📝 Enregistre l’envoi dans admin_notifications
  insert into public.admin_notifications(title, message, target_role)
  values (title, message, role_filter);

  -- 📣 Envoie une notif à chaque utilisateur selon le rôle
  for u in
    select auth.users.id
    from auth.users
    join public.profiles on profiles.id = auth.users.id
    where role_filter = 'all' or profiles.role = role_filter
  loop
    insert into public.notifications(user_id, title, message)
    values (u.id, title, message);
  end loop;
end;
$$;


--
-- TOC entry 695 (class 1255 OID 160004)
-- Name: calculate_distance_km(numeric, numeric, numeric, numeric); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.calculate_distance_km(lat1 numeric, lng1 numeric, lat2 numeric, lng2 numeric) RETURNS numeric
    LANGUAGE plpgsql IMMUTABLE
    AS $$
DECLARE
  r CONSTANT DECIMAL := 6371; -- Rayon de la Terre en km
  dlat DECIMAL;
  dlng DECIMAL;
  a DECIMAL;
  c DECIMAL;
BEGIN
  -- Vérification des paramètres d'entrée
  IF lat1 IS NULL OR lng1 IS NULL OR lat2 IS NULL OR lng2 IS NULL THEN
    RETURN NULL;
  END IF;
  
  dlat := RADIANS(lat2 - lat1);
  dlng := RADIANS(lng2 - lng1);
  
  a := SIN(dlat/2) * SIN(dlat/2) + COS(RADIANS(lat1)) * COS(RADIANS(lat2)) * SIN(dlng/2) * SIN(dlng/2);
  c := 2 * ATAN2(SQRT(a), SQRT(1-a));
  
  RETURN r * c;
END;
$$;


