--
-- TOC entry 768 (class 1255 OID 160746)
-- Name: calculate_eta(uuid, numeric, numeric); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.calculate_eta(p_fourmiz_id uuid, p_destination_lat numeric, p_destination_lng numeric) RETURNS TABLE(distance_km numeric, eta_minutes integer, transport_mode text)
    LANGUAGE plpgsql
    AS $$
DECLARE
  v_current_lat NUMERIC;
  v_current_lng NUMERIC;
  v_speed_kmh NUMERIC;
  v_movement_status TEXT;
  v_distance NUMERIC;
  v_estimated_speed NUMERIC;
BEGIN
  -- Récupérer la position actuelle du Fourmiz
  SELECT current_latitude, current_longitude, speed_kmh, movement_status
  INTO v_current_lat, v_current_lng, v_speed_kmh, v_movement_status
  FROM profiles 
  WHERE user_id = p_fourmiz_id;
  
  IF v_current_lat IS NULL THEN
    RETURN;
  END IF;
  
  -- Calculer la distance
  v_distance := 111.0 * SQRT(
    POWER(v_current_lat - p_destination_lat, 2) + 
    POWER((v_current_lng - p_destination_lng) * cos(radians(p_destination_lat)), 2)
  );
  
  -- Estimer la vitesse selon le mode de transport
  v_estimated_speed := CASE 
    WHEN v_movement_status = 'driving' THEN GREATEST(v_speed_kmh, 20.0)
    WHEN v_movement_status = 'walking' THEN GREATEST(v_speed_kmh, 4.0)
    ELSE 15.0  -- Vitesse par défaut
  END;
  
  RETURN QUERY SELECT 
    ROUND(v_distance, 2) as distance_km,
    ROUND((v_distance / v_estimated_speed * 60)::numeric)::integer as eta_minutes,
    v_movement_status as transport_mode;
END;
$$;


--
-- TOC entry 629 (class 1255 OID 59937)
-- Name: calculate_profil_complet_pourcent(boolean, text[], integer[], text[], text[], numeric, text, text, text[]); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.calculate_profil_complet_pourcent(p_rgpd_ok boolean, p_categories text[], p_services integer[], p_transport text[], p_disponibilites text[], p_prix numeric, p_location text, p_experience text, p_langues text[]) RETURNS integer
    LANGUAGE plpgsql
    AS $$
DECLARE
  total_points integer := 0;
BEGIN
  -- RGPD (20 points)
  IF p_rgpd_ok THEN total_points := total_points + 20; END IF;
  
  -- Services (20 points)
  IF array_length(p_categories, 1) > 0 OR array_length(p_services, 1) > 0 THEN
    total_points := total_points + 20;
  END IF;
  
  -- Transport (15 points)
  IF array_length(p_transport, 1) > 0 THEN total_points := total_points + 15; END IF;
  
  -- Disponibilités (15 points)
  IF array_length(p_disponibilites, 1) > 0 THEN total_points := total_points + 15; END IF;
  
  -- Tarifs (10 points)
  IF p_prix > 0 THEN total_points := total_points + 10; END IF;
  
  -- Localisation (10 points)
  IF p_location IS NOT NULL AND length(p_location) > 3 THEN total_points := total_points + 10; END IF;
  
  -- Expérience (10 points)
  IF p_experience IS NOT NULL OR array_length(p_langues, 1) > 0 THEN total_points := total_points + 10; END IF;
  
  RETURN total_points;
END;
$$;


--
-- TOC entry 574 (class 1255 OID 143783)
-- Name: calculate_profile_completion(uuid); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.calculate_profile_completion(profile_id uuid) RETURNS integer
    LANGUAGE plpgsql
    AS $$
DECLARE
    completion_percentage INTEGER;
BEGIN
    SELECT 
        -- Champs obligatoires (20 points chacun)
        CASE WHEN lastname IS NOT NULL AND lastname != '' THEN 20 ELSE 0 END +
        CASE WHEN email IS NOT NULL AND email != '' THEN 20 ELSE 0 END +
        CASE WHEN phone IS NOT NULL AND phone != '' THEN 20 ELSE 0 END +
        
        -- Champs profil fourmiz (10 points chacun)
        CASE WHEN bio IS NOT NULL AND bio != '' THEN 10 ELSE 0 END +
        CASE WHEN skills IS NOT NULL AND array_length(skills, 1) > 0 THEN 10 ELSE 0 END +
        CASE WHEN hourly_rate IS NOT NULL THEN 10 ELSE 0 END +
        CASE WHEN experience_years IS NOT NULL THEN 5 ELSE 0 END +
        
        -- Champs bonus (5 points chacun)
        CASE WHEN portfolio_images IS NOT NULL AND array_length(portfolio_images, 1) > 0 THEN 5 ELSE 0 END +
        CASE WHEN certifications IS NOT NULL AND array_length(certifications, 1) > 0 THEN 5 ELSE 0 END +
        CASE WHEN languages IS NOT NULL AND array_length(languages, 1) > 1 THEN 5 ELSE 0 END
        
    INTO completion_percentage
    FROM profiles 
    WHERE user_id = profile_id;  -- Attention: peut-être "id" au lieu de "user_id"
    
    RETURN COALESCE(completion_percentage, 0);
END;
$$;


