$$;


--
-- TOC entry 539 (class 1255 OID 76837)
-- Name: can_be_referred(uuid); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.can_be_referred(p_user_id uuid) RETURNS TABLE(can_refer boolean, user_type text, message text)
    LANGUAGE plpgsql
    AS $$
DECLARE
  user_roles text[];
  has_valid_role boolean := false;
  role_type text := 'unknown';
BEGIN
  user_roles := get_user_roles(p_user_id);
  
  IF 'client' = ANY(user_roles) AND 'fourmiz' = ANY(user_roles) THEN
    has_valid_role := true;
    role_type := 'hybrid';
  ELSIF 'client' = ANY(user_roles) THEN
    has_valid_role := true;
    role_type := 'client';
  ELSIF 'fourmiz' = ANY(user_roles) THEN
    has_valid_role := true;
    role_type := 'fourmiz';
  ELSIF 'admin' = ANY(user_roles) THEN
    has_valid_role := false;
    role_type := 'admin';
  ELSE
    has_valid_role := false;
    role_type := 'user';
  END IF;
  
  RETURN QUERY SELECT 
    has_valid_role,
    role_type,
    CASE 
      WHEN has_valid_role THEN format('Utilisateur %s peut être parrainé', role_type)
      WHEN role_type = 'admin' THEN 'Les administrateurs ne peuvent pas être parrainés'
      ELSE 'Rôle insuffisant - doit être client ou fourmiz'
    END;
END;
$$;


--
-- TOC entry 572 (class 1255 OID 53206)
-- Name: cancel_order(integer, uuid, text); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.cancel_order(p_order_id integer, p_cancelled_by uuid, p_reason text DEFAULT NULL::text) RETURNS json
    LANGUAGE plpgsql
    AS $$
DECLARE
  order_status VARCHAR(20);
  order_urgency VARCHAR(20);
  proposed_amount DECIMAL(10,2);
  cancellation_fee DECIMAL(10,2) := 0;
  is_fourmiz_confirmed BOOLEAN;
  result JSON;
BEGIN
  SELECT status, urgency_level, proposed_amount, confirmed_by_fourmiz
  INTO order_status, order_urgency, proposed_amount, is_fourmiz_confirmed
  FROM orders WHERE id = p_order_id;

  IF NOT FOUND THEN
    RETURN json_build_object('success', false, 'error', 'Commande non trouvée');
  END IF;

  IF order_status = 'CANCELLED' THEN
    RETURN json_build_object('success', false, 'error', 'Commande déjà annulée');
  END IF;

  IF is_fourmiz_confirmed AND order_urgency != 'normal' THEN
    cancellation_fee := proposed_amount * 0.5;
  END IF;

  UPDATE orders
  SET status = 'CANCELLED',
      cancelled_at = NOW(),
      cancelled_by = p_cancelled_by,
      cancellation_fee = cancellation_fee
  WHERE id = p_order_id;

  result := json_build_object(
    'success', true,
    'cancellation_fee', cancellation_fee,
    'message', CASE 
      WHEN cancellation_fee > 0 THEN 'Commande annulée avec frais'
      ELSE 'Commande annulée sans frais'
    END
  );

  RETURN result;
END;
$$;


--
-- TOC entry 675 (class 1255 OID 67814)
-- Name: check_referral_code(text); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.check_referral_code(input_code text) RETURNS TABLE(code_exists boolean, referrer_user_id uuid, referrer_name text, is_active boolean)
    LANGUAGE plpgsql
    AS $$
BEGIN
  RETURN QUERY
  SELECT 
    (urc.code IS NOT NULL) as code_exists,
    urc.user_id as referrer_user_id,
    COALESCE(p.firstname || ' ' || p.lastname, 'Utilisateur') as referrer_name,
    COALESCE(urc.is_active, false) as is_active
  FROM user_referral_codes urc
  LEFT JOIN profiles p ON p.id = urc.user_id
  WHERE urc.code = input_code;
  
  IF NOT FOUND THEN
    RETURN QUERY SELECT false, NULL::UUID, ''::TEXT, false;
  END IF;
END;
$$;


--
-- TOC entry 547 (class 1255 OID 123286)
-- Name: check_trigger_activity(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.check_trigger_activity() RETURNS TABLE(table_name text, trigger_name text, is_active boolean)
    LANGUAGE plpgsql
    AS $$
BEGIN
  RETURN QUERY
  SELECT 
    t.event_object_table::text,
    t.trigger_name::text,
    (t.action_statement IS NOT NULL) as is_active
  FROM information_schema.triggers t
  WHERE t.trigger_schema = 'public' 
  AND t.event_object_table IN ('orders', 'profiles')
  ORDER BY t.event_object_table, t.trigger_name;
END;
$$;


--
-- TOC entry 622 (class 1255 OID 147679)
-- Name: check_user_fourmiz_engagements(uuid); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.check_user_fourmiz_engagements(p_user_id uuid) RETURNS boolean
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
    required_count INTEGER;
    accepted_count INTEGER;
BEGIN
    -- Compter les engagements requis pour Fourmiz
    SELECT COUNT(*) INTO required_count
    FROM public.legal_engagement_types
    WHERE is_active = true AND is_required_for_fourmiz = true;
    
    -- Compter les engagements acceptés et valides
    SELECT COUNT(*) INTO accepted_count
    FROM public.user_engagement_status
    WHERE user_id = p_user_id AND is_current_and_valid = true;
    
    RETURN accepted_count >= required_count;
END;
$$;


