CREATE FUNCTION public.cleanup_location_history(p_keep_days integer DEFAULT 30) RETURNS text
    LANGUAGE plpgsql
    AS $$
DECLARE
  v_deleted_count INTEGER;
BEGIN
  DELETE FROM location_history 
  WHERE recorded_at < NOW() - (p_keep_days || ' days')::INTERVAL;
  
  GET DIAGNOSTICS v_deleted_count = ROW_COUNT;
  
  RETURN 'Supprimé ' || v_deleted_count || ' enregistrements anciens';
END;
$$;


