-- TOC entry 568 (class 1255 OID 143781)
-- Name: copy_service_workflow(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.copy_service_workflow() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    -- Si la commande a un service_id, copier son workflow_type
    IF NEW.service_id IS NOT NULL THEN
        SELECT workflow_type INTO NEW.workflow_type 
        FROM services 
        WHERE id = NEW.service_id;
    END IF;
    
    -- Si pas de workflow_type défini, utiliser 'direct' par défaut
    IF NEW.workflow_type IS NULL THEN
        NEW.workflow_type := 'direct';
    END IF;
    
    RETURN NEW;
END;
$$;


