    LANGUAGE plpgsql
    AS $$
BEGIN
    -- Si le statut passe à 'acceptee' et qu'une fourmiz est assignée
    IF OLD.status != 'acceptee' AND NEW.status = 'acceptee' AND NEW.fourmiz_id IS NOT NULL THEN
        INSERT INTO chat_messages (order_id, sender_id, message, message_type)
        VALUES (
            NEW.id,
