$$;


--
-- TOC entry 606 (class 1255 OID 84532)
-- Name: create_order_with_details(uuid, integer, text, numeric, text, character varying, character varying, character varying, boolean, character varying, boolean, date, time without time zone, text, text, character varying, character varying, text, text, character varying, integer, text, character varying, character varying, character varying, character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.create_order_with_details(p_client_id uuid, p_service_id integer, p_description text, p_proposed_amount numeric, p_address text, p_postal_code character varying, p_city character varying, p_phone character varying, p_urgent boolean, p_urgency_level character varying, p_invoice_required boolean, p_date date, p_start_time time without time zone, p_departure_address text, p_arrival_address text, p_arrival_postal_code character varying, p_arrival_city character varying, p_delivery_address text, p_pickup_address text, p_alternative_phone character varying DEFAULT NULL::character varying, p_duration integer DEFAULT NULL::integer, p_equipment text DEFAULT NULL::text, p_package_number character varying DEFAULT NULL::character varying, p_invoice_type character varying DEFAULT 'particulier'::character varying, p_company_name character varying DEFAULT NULL::character varying, p_siret character varying DEFAULT NULL::character varying) RETURNS TABLE(order_id integer, detail_id integer)
    LANGUAGE plpgsql
    AS $$
DECLARE
    v_order_id INTEGER;
    v_detail_id INTEGER;
    v_end_time TIME;
    v_addresses_json JSONB;
BEGIN
    -- Calculer l'heure de fin si durée fournie
    IF p_duration IS NOT NULL AND p_start_time IS NOT NULL THEN
        v_end_time := (p_start_time + (p_duration || ' minutes')::INTERVAL)::TIME;
    END IF;

    -- Préparer le JSON addresses pour compatibilité
    v_addresses_json := jsonb_build_object(
        'main_address', p_address,
        'city', p_city,
        'postal_code', p_postal_code,
        'departure_address', COALESCE(p_departure_address, p_address),
        'arrival_address', COALESCE(p_arrival_address, ''),
        'arrival_city', COALESCE(p_arrival_city, ''),
        'arrival_postal_code', COALESCE(p_arrival_postal_code, ''),
        'pickup_address', COALESCE(p_pickup_address, ''),
        'delivery_address', COALESCE(p_delivery_address, ''),
        'category', (SELECT categorie FROM services WHERE id = p_service_id)
    );

    -- Insérer dans orders
    INSERT INTO orders (
        client_id, service_id, description, proposed_amount,
        address, postal_code, city, phone,
        urgent, urgency_level, invoice_required,
        date, start_time, end_time,
        departure_address, arrival_address, arrival_postal_code,
        arrival_city, delivery_address, pickup_address,
        status, addresses, created_at, updated_at
    ) VALUES (
        p_client_id, p_service_id, p_description, p_proposed_amount,
        p_address, p_postal_code, p_city, p_phone,
        p_urgent, p_urgency_level, p_invoice_required,
        p_date, p_start_time, v_end_time,
        COALESCE(p_departure_address, p_address), p_arrival_address, p_arrival_postal_code,
        p_arrival_city, p_delivery_address, p_pickup_address,
        'en_attente', v_addresses_json, NOW(), NOW()
    ) RETURNING id INTO v_order_id;

    -- Insérer dans order_details si nécessaire
    IF p_alternative_phone IS NOT NULL OR 
       p_duration IS NOT NULL OR 
       p_equipment IS NOT NULL OR 
       p_package_number IS NOT NULL OR 
       p_invoice_type != 'particulier' OR 
       p_company_name IS NOT NULL OR 
       p_siret IS NOT NULL THEN
       
        INSERT INTO order_details (
            order_id, alternative_phone, duration,
            equipment, package_number, invoice_type,
            company_name, siret
        ) VALUES (
            v_order_id, p_alternative_phone, p_duration,
            p_equipment, p_package_number, COALESCE(p_invoice_type, 'particulier'),
            p_company_name, p_siret
        ) RETURNING id INTO v_detail_id;
    END IF;

    RETURN QUERY SELECT v_order_id, v_detail_id;
END;
$$;


--
-- TOC entry 603 (class 1255 OID 76340)
-- Name: create_referral_commission(bigint, bigint, numeric, numeric); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.create_referral_commission(p_referral_id bigint, p_order_id bigint, p_order_amount numeric, p_commission_rate numeric DEFAULT 5.00) RETURNS boolean
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
  v_commission_amount numeric;
  v_parrain_id uuid;
  v_filleul_id uuid;
BEGIN
  -- Essayer de récupérer les IDs depuis la table referrals
  -- Adaptez les noms de colonnes selon votre structure
  BEGIN
    SELECT parrain_id, filleul_id 
    INTO v_parrain_id, v_filleul_id
    FROM referrals 
    WHERE id = p_referral_id;
    
    -- Si les colonnes s'appellent différemment, adaptez :
    -- SELECT sponsor_id, referred_id INTO v_parrain_id, v_filleul_id
    -- FROM referrals WHERE id = p_referral_id;
    
  EXCEPTION 
    WHEN OTHERS THEN
      RAISE LOG 'Erreur accès table referrals: %', SQLERRM;
      RETURN false;
  END;

  IF v_parrain_id IS NULL THEN
    RAISE EXCEPTION 'Relation de parrainage non trouvée: %', p_referral_id;
  END IF;

  -- Calculer la commission
  v_commission_amount := (p_order_amount * p_commission_rate) / 100;

  -- Insérer la commission
  INSERT INTO referral_commissions (
    referral_id,
    parrain_id,
    filleul_id,
    order_id,
    commission_amount,
    commission_rate,
    order_amount,
    status,
    earned_at
  ) VALUES (
    p_referral_id,
    v_parrain_id,
    v_filleul_id,
    p_order_id,
    v_commission_amount,
    p_commission_rate,
    p_order_amount,
    'pending',
    now()
  );

  RETURN true;
EXCEPTION
  WHEN OTHERS THEN
    RAISE LOG 'Erreur création commission: %', SQLERRM;
    RETURN false;
END;
$$;


