--
-- TOC entry 732 (class 1255 OID 77042)
-- Name: create_referral_dynamic_with_role_check(uuid, uuid, character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.create_referral_dynamic_with_role_check(p_parrain_id uuid, p_filleul_id uuid, p_referral_code character varying DEFAULT NULL::character varying) RETURNS TABLE(referral_id bigint, signup_gain_id bigint, bonus_amount numeric, commission_rate numeric, success boolean, message text)
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
  v_referral_id bigint;
  v_gain_id bigint;
  v_bonus_amount numeric;
  v_commission_rate numeric;
  v_filleul_roles text[];
  v_parrain_can_refer boolean;
  v_filleul_can_refer boolean;
  v_parrain_type text;
  v_filleul_type text;
  v_gain_type text;
  v_system_enabled boolean;
BEGIN
  -- Vérifier si le système de parrainage est activé
  SELECT get_referral_config('referral_system_enabled', 1) > 0 INTO v_system_enabled;
  
  IF NOT v_system_enabled THEN
    RETURN QUERY SELECT NULL, NULL, 0, 0, false, 'Système de parrainage désactivé par admin';
    RETURN;
  END IF;

  -- Vérifier que les utilisateurs peuvent être parrainés
  SELECT can_refer, user_type INTO v_parrain_can_refer, v_parrain_type
  FROM can_be_referred(p_parrain_id);
  
  SELECT can_refer, user_type INTO v_filleul_can_refer, v_filleul_type
  FROM can_be_referred(p_filleul_id);
  
  IF NOT v_parrain_can_refer THEN
    RETURN QUERY SELECT NULL, NULL, 0, 0, false, format('Parrain invalide: %s', v_parrain_type);
    RETURN;
  END IF;
  
  IF NOT v_filleul_can_refer THEN
    RETURN QUERY SELECT NULL, NULL, 0, 0, false, format('Filleul invalide: %s', v_filleul_type);
    RETURN;
  END IF;

  -- Vérifier si le filleul n'est pas déjà parrainé
  IF EXISTS(SELECT 1 FROM referrals WHERE filleul_id = p_filleul_id) THEN
    RETURN QUERY SELECT NULL, NULL, 0, 0, false, 'Filleul déjà parrainé';
    RETURN;
  END IF;

  -- Récupérer les rôles et déterminer les paramètres
  v_filleul_roles := get_user_roles(p_filleul_id);

  -- Déterminer le type de parrainage selon les rôles du filleul
  IF 'fourmiz' = ANY(v_filleul_roles) AND 'client' = ANY(v_filleul_roles) THEN
    -- Profil hybride - utiliser les paramètres fourmiz (plus avantageux)
    v_bonus_amount := get_referral_config('referral_bonus_amount', 10);
    v_commission_rate := get_referral_config('referral_fourmiz_commission_rate', 3.5);
    v_gain_type := 'hybrid_profile';
  ELSIF 'fourmiz' = ANY(v_filleul_roles) THEN
    -- Profil fourmiz uniquement
    v_bonus_amount := get_referral_config('referral_bonus_amount', 10);
    v_commission_rate := get_referral_config('referral_fourmiz_commission_rate', 3.5);
    v_gain_type := 'fourmiz_service';
  ELSIF 'client' = ANY(v_filleul_roles) THEN
    -- Profil client uniquement
    v_bonus_amount := get_referral_config('referral_bonus_amount', 10);
    v_commission_rate := get_referral_config('referral_client_commission_rate', 5);
    v_gain_type := 'client_order';
  ELSE
    -- Ne devrait jamais arriver grâce aux vérifications précédentes
    RETURN QUERY SELECT NULL, NULL, 0, 0, false, 'Rôles insuffisants pour le parrainage';
    RETURN;
  END IF;

  -- ✅ Créer la relation de parrainage avec VOS colonnes exactes
  INSERT INTO referrals (
    parrain_id,
    filleul_id,
    created_at,
    is_validated,
    bonus_amount,
    commission_percent,
    total_commission_earned
  ) VALUES (
    p_parrain_id,
    p_filleul_id,
    now(),
    false,
    v_bonus_amount,
    v_commission_rate,
    0  -- Pas encore de commission gagnée
  ) RETURNING id INTO v_referral_id;

  -- ✅ Créer le gain initial
  INSERT INTO referral_gains (
    sponsor_id,
    referred_id,
    amount,
    type,
    status,
    description,
    metadata
  ) VALUES (
    p_parrain_id,
    p_filleul_id,
    v_bonus_amount,
    v_gain_type,
    'pending',
    format('Bonus inscription %s - Paramètres admin', v_filleul_type),
    jsonb_build_object(
      'referral_code', COALESCE(p_referral_code, 'DIRECT'),
      'parrain_roles', get_user_roles(p_parrain_id),
      'filleul_roles', v_filleul_roles,
      'parrain_type', v_parrain_type,
      'filleul_type', v_filleul_type,
      'referral_id', v_referral_id,
      'config_source', 'admin_dashboard_with_roles',
      'commission_rate', v_commission_rate,
      'min_order_amount', get_referral_config('referral_min_order_amount', 20),
      'created_from', 'role_validated_system'
    )
  ) RETURNING id INTO v_gain_id;

  RETURN QUERY SELECT 
    v_referral_id, 
    v_gain_id, 
    v_bonus_amount, 
    v_commission_rate, 
    true, 
    format('Parrainage %s->%s créé avec succès', v_parrain_type, v_filleul_type);
END;
$$;


--
-- TOC entry 733 (class 1255 OID 76596)
-- Name: create_referral_gain_real(uuid, uuid, numeric, text, text); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.create_referral_gain_real(p_sponsor_id uuid, p_referred_id uuid, p_amount numeric DEFAULT 5.00, p_type text DEFAULT 'signup_bonus'::text, p_description text DEFAULT NULL::text) RETURNS bigint
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
