  IF EXISTS(SELECT 1 FROM referral_gains WHERE referred_id = p_referred_id) THEN
    RAISE EXCEPTION 'Utilisateur % déjà parrainé', p_referred_id;
  END IF;
  
  -- Créer le gain
  INSERT INTO referral_gains (
    sponsor_id,
    referred_id,
    amount,
    type,
    status,
    description,
    created_at,
    metadata
  ) VALUES (
    p_sponsor_id,
    p_referred_id,
    p_amount,
    p_type,
    'pending',
    COALESCE(p_description, 'Gain de parrainage'),
    now(),
    jsonb_build_object(
      'sponsor_id', p_sponsor_id,
      'referred_id', p_referred_id,
      'created_by', 'referral_system'
    )
  ) RETURNING id INTO v_gain_id;
  
  RETURN v_gain_id;
END;
$$;


--
-- TOC entry 747 (class 1255 OID 76447)
-- Name: create_user_referral_code_safe(uuid); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.create_user_referral_code_safe(p_user_id uuid) RETURNS character varying
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
  v_code varchar(6);
BEGIN
  -- Vérifier si l'utilisateur a déjà un code actif
  SELECT code INTO v_code
  FROM user_referral_codes
  WHERE user_id = p_user_id AND is_active = true
  LIMIT 1;
  
  -- Si un code existe, le retourner
  IF v_code IS NOT NULL THEN
    RETURN v_code;
  END IF;
  
  -- Générer un nouveau code
  v_code := generate_referral_code_fallback();
  
  -- Insérer avec toutes les colonnes maintenant disponibles
  INSERT INTO user_referral_codes (
    user_id, 
    code, 
    is_active, 
    usage_count, 
    created_at, 
    updated_at
  ) VALUES (
    p_user_id, 
    v_code, 
    true, 
    0, 
    now(), 
    now()
  );
  
  RETURN v_code;
END;
$$;


