CREATE FUNCTION public.create_user_referral_code_simple(p_user_id uuid) RETURNS character varying
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
  v_code varchar(6);
  v_user_exists boolean := false;
BEGIN
  -- Vérifier que l'utilisateur existe (essayer toutes les tables)
  BEGIN
    SELECT EXISTS(SELECT 1 FROM users WHERE id = p_user_id) INTO v_user_exists;
  EXCEPTION
    WHEN undefined_table THEN
      BEGIN
        SELECT EXISTS(SELECT 1 FROM profiles WHERE id = p_user_id) INTO v_user_exists;
      EXCEPTION
        WHEN undefined_table THEN
          BEGIN
            SELECT EXISTS(SELECT 1 FROM auth_users WHERE id = p_user_id) INTO v_user_exists;
          EXCEPTION
            WHEN undefined_table THEN
              RAISE EXCEPTION 'Aucune table utilisateur trouvée';
          END;
      END;
  END;
  
  IF NOT v_user_exists THEN
    RAISE EXCEPTION 'Utilisateur avec ID % introuvable', p_user_id;
  END IF;
  
  -- Vérifier si l'utilisateur a déjà un code actif
  SELECT code INTO v_code
  FROM user_referral_codes
  WHERE user_id = p_user_id 
    AND is_active = true
    AND (expires_at IS NULL OR expires_at > now())
  LIMIT 1;
  
  -- Si un code valide existe, le retourner
  IF v_code IS NOT NULL THEN
    RETURN v_code;
  END IF;
  
  -- Générer un nouveau code unique
  v_code := generate_referral_code_fallback();
  
  -- Insérer le nouveau code
  INSERT INTO user_referral_codes (
    user_id, 
    code, 
    is_active, 
    usage_count, 
    created_at, 
    updated_at
  ) VALUES (
    p_user_id, 
    v_code, 
    true, 
    0, 
    now(), 
    now()
  );
  
  RETURN v_code;
END;
$$;


