--

CREATE FUNCTION public.credit_wallet(target_user_id uuid, credit_amount numeric, credit_type character varying, credit_source character varying, credit_description text) RETURNS uuid
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
  credit_id UUID;
BEGIN
  IF credit_amount <= 0 THEN
    RAISE EXCEPTION 'Amount must be positive';
  END IF;
  
  INSERT INTO user_credits (user_id, amount, type, source, description, status)
  VALUES (target_user_id, credit_amount, credit_type, credit_source, credit_description, 'completed')
  RETURNING id INTO credit_id;
  
  RETURN credit_id;
END;
$$;


--
-- TOC entry 546 (class 1255 OID 132530)
-- Name: debit_wallet(uuid, numeric, character varying, character varying, text); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.debit_wallet(target_user_id uuid, debit_amount numeric, debit_type character varying, debit_source character varying, debit_description text) RETURNS uuid
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
  current_balance DECIMAL(10,2);
  debit_id UUID;
BEGIN
  IF debit_amount <= 0 THEN
    RAISE EXCEPTION 'Amount must be positive';
  END IF;
  
  -- Vérifier le solde
  SELECT calculate_wallet_balance(target_user_id) INTO current_balance;
  
  IF current_balance < debit_amount THEN
    RAISE EXCEPTION 'Insufficient balance. Available: %, Required: %', current_balance, debit_amount;
  END IF;
  
  -- Créer l'entrée de débit (montant négatif)
  INSERT INTO user_credits (user_id, amount, type, source, description, status)
  VALUES (target_user_id, -debit_amount, debit_type, debit_source, debit_description, 'completed')
  RETURNING id INTO debit_id;
  
  RETURN debit_id;
END;
$$;


--
-- TOC entry 710 (class 1255 OID 76492)
-- Name: detect_user_table_structure(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.detect_user_table_structure() RETURNS TABLE(table_name text, id_column text, name_columns text[], email_column text)
    LANGUAGE plpgsql
    AS $$
DECLARE
  v_table_name text;
  v_id_column text := 'id';
  v_name_columns text[] := '{}';
  v_email_column text;
  col_record record;
BEGIN
  -- Détecter quelle table utilisateur existe
  FOR v_table_name IN 
    SELECT t.table_name 
    FROM information_schema.tables t
    WHERE t.table_name IN ('users', 'profiles', 'auth_users')
      AND t.table_schema = 'public'
    ORDER BY 
      CASE t.table_name 
        WHEN 'users' THEN 1
        WHEN 'profiles' THEN 2
        WHEN 'auth_users' THEN 3
      END
    LIMIT 1
  LOOP
    -- Détecter les colonnes disponibles (CORRIGÉ: utilisation d'alias)
    FOR col_record IN
      SELECT c.column_name
      FROM information_schema.columns c
      WHERE c.table_name = v_table_name
        AND c.table_schema = 'public'
        AND c.data_type IN ('character varying', 'text', 'varchar')
    LOOP
      -- Détecter colonne email
      IF col_record.column_name ILIKE '%email%' THEN
        v_email_column := col_record.column_name;
      END IF;
      
      -- Détecter colonnes de nom
      IF col_record.column_name ILIKE ANY(ARRAY['%name%', '%first%', '%last%', '%username%', '%login%']) THEN
        v_name_columns := array_append(v_name_columns, col_record.column_name);
      END IF;
    END LOOP;
    
    -- Retourner le résultat pour la première table trouvée
    RETURN QUERY SELECT v_table_name, v_id_column, v_name_columns, v_email_column;
    RETURN;
  END LOOP;
  
  -- Si aucune table trouvée
  RETURN QUERY SELECT 'users'::text, 'id'::text, '{}'::text[], 'email'::text;
END;
$$;


--
-- TOC entry 785 (class 1255 OID 160745)
-- Name: find_available_fourmiz(numeric, numeric, numeric, uuid, boolean, integer); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.find_available_fourmiz(p_client_latitude numeric, p_client_longitude numeric, p_radius_km numeric DEFAULT 5.0, p_service_category_id uuid DEFAULT NULL::uuid, p_include_moving boolean DEFAULT true, p_max_response_time_minutes integer DEFAULT 60) RETURNS TABLE(user_id uuid, firstname text, lastname text, phone text, distance_km numeric, movement_status text, speed_kmh numeric, response_time_minutes integer, is_available boolean, service_category_id uuid, last_update_ago text)
    LANGUAGE plpgsql
    AS $$
BEGIN
  RETURN QUERY
  SELECT 
    p.user_id,
    p.firstname,
    p.lastname,
    p.phone,
    -- Distance approximative
    ROUND(
      (111.0 * SQRT(
        POWER(p.current_latitude - p_client_latitude, 2) + 
        POWER((p.current_longitude - p_client_longitude) * cos(radians(p_client_latitude)), 2)
      ))::numeric, 2
    ) as distance_km,
    p.movement_status,
    COALESCE(p.speed_kmh, 0) as speed_kmh,
    p.response_time_minutes,
    p.is_available,
    p.service_category_id,
    CASE 
      WHEN EXTRACT(EPOCH FROM (NOW() - p.current_location_updated_at)) < 300 THEN 'Très récent'
      WHEN EXTRACT(EPOCH FROM (NOW() - p.current_location_updated_at)) < 900 THEN 'Récent'
      ELSE 'Ancien'
    END as last_update_ago
  FROM profiles p
  WHERE 
    'fourmiz' = ANY(p.roles)
    AND p.tracking_enabled = TRUE
    AND p.is_available = TRUE
    AND p.current_latitude IS NOT NULL 
    AND p.current_longitude IS NOT NULL
    AND p.current_location_updated_at > NOW() - INTERVAL '30 minutes'
    AND p.response_time_minutes <= p_max_response_time_minutes
    AND (p_service_category_id IS NULL OR p.service_category_id = p_service_category_id)
    AND (p_include_moving OR p.movement_status = 'stationary')
    -- Filtre de distance
    AND (
      111.0 * SQRT(
        POWER(p.current_latitude - p_client_latitude, 2) + 
        POWER((p.current_longitude - p_client_longitude) * cos(radians(p_client_latitude)), 2)
      )
    ) <= p_radius_km
  ORDER BY 
    p.is_available DESC,
    distance_km ASC,
    p.response_time_minutes ASC
  LIMIT 10;
END;
$$;


