CREATE FUNCTION public.find_fourmiz_nearby_simple(p_latitude numeric, p_longitude numeric, p_radius_km numeric DEFAULT 5.0) RETURNS TABLE(user_id uuid, firstname text, lastname text, phone text, current_latitude numeric, current_longitude numeric, movement_status text, speed_kmh numeric, minutes_since_update integer)
    LANGUAGE plpgsql
    AS $$
BEGIN
  RETURN QUERY
  SELECT 
    p.user_id,
    p.firstname,
    p.lastname,
    p.phone,
    p.current_latitude,
    p.current_longitude,
    p.movement_status,
    COALESCE(p.speed_kmh, 0) as speed_kmh,
