    -- Calcul de distance simplifié (approximatif pour petites distances)
    AND (
      POWER(p.current_latitude - p_latitude, 2) + 
      POWER((p.current_longitude - p_longitude) * cos(radians(p_latitude)), 2)
    ) <= POWER(p_radius_km / 111.0, 2)  -- 111 km ≈ 1 degré
