--
-- TOC entry 544 (class 1255 OID 160005)
-- Name: find_profiles_within_radius(numeric, numeric, numeric, text); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.find_profiles_within_radius(center_lat numeric, center_lng numeric, radius_km numeric DEFAULT 10, profile_type text DEFAULT NULL::text) RETURNS TABLE(user_id uuid, distance_km numeric, latitude numeric, longitude numeric, firstname text, lastname text, roles text[])
    LANGUAGE plpgsql STABLE
    AS $$
DECLARE
  lat_delta DECIMAL;
  lng_delta DECIMAL;
BEGIN
  -- Calcul approximatif des bornes géographiques pour optimiser la requête
  lat_delta := radius_km / 111.0; -- 1 degré latitude ≈ 111 km
  lng_delta := radius_km / (111.0 * COS(RADIANS(center_lat)));
  
  RETURN QUERY
  SELECT 
    p.user_id,
    calculate_distance_km(center_lat, center_lng, p.latitude, p.longitude) as distance_km,
    p.latitude,
    p.longitude,
    p.firstname,
    p.lastname,
    p.roles
  FROM profiles p
  WHERE 
    p.latitude IS NOT NULL 
    AND p.longitude IS NOT NULL
    AND p.latitude BETWEEN (center_lat - lat_delta) AND (center_lat + lat_delta)
    AND p.longitude BETWEEN (center_lng - lng_delta) AND (center_lng + lng_delta)
    AND (profile_type IS NULL OR profile_type = ANY(p.roles))
    AND calculate_distance_km(center_lat, center_lng, p.latitude, p.longitude) <= radius_km
  ORDER BY distance_km ASC;
END;
$$;


