-- TOC entry 566 (class 1255 OID 76310)
-- Name: generate_referral_code(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.generate_referral_code() RETURNS character varying
    LANGUAGE plpgsql
    AS $$
DECLARE
  v_code VARCHAR(6);
  v_exists BOOLEAN;
  v_attempts INT := 0;
  v_digits TEXT := '0123456789';
  v_letters TEXT := 'ABCDEFGHIJKLMNOPQRSTUVWXYZ';
BEGIN
  LOOP
    v_code := 
      substring(v_digits, floor(random()*10)+1, 1) ||
      substring(v_letters, floor(random()*26)+1, 1) ||
      substring(v_digits, floor(random()*10)+1, 1) ||
      substring(v_letters, floor(random()*26)+1, 1) ||
      substring(v_digits, floor(random()*10)+1, 1) ||
      substring(v_letters, floor(random()*26)+1, 1);

    SELECT EXISTS(SELECT 1 FROM user_referral_codes WHERE code = v_code) INTO v_exists;

    IF NOT v_exists THEN
      RETURN v_code;
    END IF;

    v_attempts := v_attempts + 1;
    IF v_attempts > 10 THEN
      RETURN '9Z' || LPAD((EXTRACT(EPOCH FROM NOW())::BIGINT % 10000)::TEXT, 4, '0');
    END IF;
  END LOOP;
END;
$$;


--
-- TOC entry 575 (class 1255 OID 76421)
-- Name: generate_referral_code_fallback(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.generate_referral_code_fallback() RETURNS character varying
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
  v_code varchar(6);
  v_exists boolean := true;
  v_attempts integer := 0;
  v_max_attempts integer := 100;
BEGIN
  -- Boucle pour générer un code unique
  WHILE v_exists AND v_attempts < v_max_attempts LOOP
    -- Générer un code de 6 caractères alphanumériques (sans 0, O, I, 1 pour éviter confusion)
    v_code := UPPER(
      substr(
        translate(
          encode(gen_random_bytes(10), 'base64'),
          '0O1Il+/=',
          'ABCDEFGH'
        ),
        1, 6
      )
    );
    
    -- S'assurer qu'on a exactement 6 caractères
    IF length(v_code) < 6 THEN
      v_code := v_code || substr('ABCDEFGHJKMNPQRSTUVWXYZ23456789', 1, 6 - length(v_code));
    END IF;
    
    -- Vérifier l'unicité
    SELECT EXISTS(
      SELECT 1 FROM user_referral_codes WHERE code = v_code
    ) INTO v_exists;
    
    v_attempts := v_attempts + 1;
  END LOOP;
  
  -- Si on n'arrive pas à générer un code unique après max_attempts
  IF v_exists THEN
    RAISE EXCEPTION 'Impossible de générer un code unique après % tentatives', v_max_attempts;
  END IF;
  
  RETURN v_code;
END;
$$;


--
-- TOC entry 607 (class 1255 OID 76422)
-- Name: generate_referral_code_simple(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.generate_referral_code_simple() RETURNS character varying
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
  v_code varchar(6);
  v_exists boolean := true;
  v_attempts integer := 0;
  v_chars text := 'ABCDEFGHJKMNPQRSTUVWXYZ23456789'; -- Évite 0, O, 1, I
  i integer;
BEGIN
  WHILE v_exists AND v_attempts < 100 LOOP
    v_code := '';
    
    -- Construire le code caractère par caractère
    FOR i IN 1..6 LOOP
      v_code := v_code || substr(v_chars, floor(random() * length(v_chars) + 1)::integer, 1);
    END LOOP;
    
    -- Vérifier l'unicité
    SELECT EXISTS(
      SELECT 1 FROM user_referral_codes WHERE code = v_code
    ) INTO v_exists;
    
    v_attempts := v_attempts + 1;
  END LOOP;
  
  IF v_exists THEN
    RAISE EXCEPTION 'Impossible de générer un code unique';
  END IF;
  
  RETURN v_code;
END;
$$;


