--

CREATE FUNCTION public.generate_service_slug() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
declare
  base_slug text;
  new_slug text;
  counter integer := 0;
begin
  base_slug := lower(regexp_replace(new.title, '[^a-zA-Z0-9]+', '-', 'g'));
  new_slug := base_slug;

  -- Vérifier unicité
  while exists (select 1 from services where slug = new_slug) loop
    counter := counter + 1;
    new_slug := base_slug || '-' || counter;
  end loop;

  new.slug := new_slug;
  return new;
end;
$$;


