--

CREATE FUNCTION public.generate_slug(text) RETURNS text
    LANGUAGE plpgsql IMMUTABLE
    AS $_$
DECLARE
  txt text := lower($1);
BEGIN
  txt := translate(txt, 'àâäéèêëîïôöùûüç', 'aaaeeeeiioouuuc'); -- remplace accents
  txt := regexp_replace(txt, '[^a-z0-9\s-]', '', 'g');          -- supprime caractères spéciaux
  txt := regexp_replace(txt, '\s+', '-', 'g');                 -- remplace espaces par tirets
  txt := regexp_replace(txt, '-+', '-', 'g');                  -- supprime tirets doubles
  txt := trim(both '-' from txt);                              -- supprime tirets début/fin
  RETURN txt;
END;
$_$;


