CREATE FUNCTION public.generate_unique_slug(base_title text) RETURNS text
    LANGUAGE plpgsql
    AS $$
DECLARE
  base_slug text := lower(regexp_replace(base_title, '[^a-z0-9]+', '-', 'g'));
  new_slug text := base_slug;
  suffix integer := 1;
BEGIN
  WHILE EXISTS (SELECT 1 FROM services WHERE slug = new_slug) LOOP
    new_slug := base_slug || '-' || suffix;
    suffix := suffix + 1;
  END LOOP;
  RETURN new_slug;
END;
$$;


