        FROM chat_messages cm
        JOIN orders o ON cm.order_id = o.id
        LEFT JOIN profiles p ON cm.sender_id = p.id
        WHERE (o.client_id = p_user_id OR o.fourmiz_id = p_user_id)
        AND cm.deleted_at IS NULL
        ORDER BY cm.order_id, cm.created_at DESC
    ),
    unread_counts AS (
        SELECT 
            cm.order_id,
            COUNT(*) as unread_count
        FROM chat_messages cm
        JOIN orders o ON cm.order_id = o.id
        WHERE (o.client_id = p_user_id OR o.fourmiz_id = p_user_id)
        AND cm.sender_id != p_user_id
        AND cm.read_at IS NULL
        AND cm.deleted_at IS NULL
        GROUP BY cm.order_id
    )
    SELECT 
        lm.order_id,
        lm.message,
        lm.message_type,
        lm.created_at,
        lm.sender_name,
        COALESCE(uc.unread_count, 0),
        CASE 
            WHEN o.client_id = p_user_id THEN o.fourmiz_id
            ELSE o.client_id
        END as other_user_id,
        CASE 
            WHEN o.client_id = p_user_id THEN COALESCE(cp.firstname || ' ' || COALESCE(cp.lastname, ''), 'Fourmiz')
            ELSE COALESCE(fp.firstname || ' ' || COALESCE(fp.lastname, ''), 'Client')
        END as other_user_name,
        CASE 
            WHEN o.client_id = p_user_id THEN cp.avatar_url
            ELSE fp.avatar_url
        END as other_user_avatar,
        s.title,
        o.status
    FROM latest_msgs lm
    JOIN orders o ON lm.order_id = o.id
    JOIN services s ON o.service_id = s.id
    LEFT JOIN profiles cp ON o.fourmiz_id = cp.id
    LEFT JOIN profiles fp ON o.client_id = fp.id
    LEFT JOIN unread_counts uc ON lm.order_id = uc.order_id
    WHERE o.fourmiz_id IS NOT NULL
    ORDER BY lm.created_at DESC;
END;
$$;


--
-- TOC entry 627 (class 1255 OID 171370)
-- Name: get_nearby_fourmiz(numeric, numeric, integer, integer); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.get_nearby_fourmiz(user_lat numeric, user_lng numeric, radius_km integer DEFAULT 10, service_category_id integer DEFAULT NULL::integer) RETURNS TABLE(id uuid, firstname text, lastname text, avatar_url text, latitude numeric, longitude numeric, is_available boolean, rating numeric, response_time_minutes integer, service_category_name text, service_category_color text, service_category_icon text, distance_km numeric)
    LANGUAGE plpgsql
    AS $$
BEGIN
  RETURN QUERY
  SELECT 
    p.id,
    COALESCE(p.firstname, 'Fourmiz') as firstname,
    COALESCE(p.lastname, '') as lastname,
    p.avatar_url,
    COALESCE(p.latitude, 0) as latitude,
    COALESCE(p.longitude, 0) as longitude,
    COALESCE(p.is_available, false) as is_available,
    COALESCE(p.fourmiz_rating, p.default_rating, 4.5)::NUMERIC(3, 2) as rating,  -- ← CORRIGÉ : plus de p.rating
    COALESCE(p.response_time_minutes, 30) as response_time_minutes,
    'Service général' as service_category_name,
    '#757575' as service_category_color,
    'person' as service_category_icon,
    ROUND(
      6371 * acos(
        cos(radians(user_lat)) * cos(radians(COALESCE(p.latitude, 0))) * 
        cos(radians(COALESCE(p.longitude, 0)) - radians(user_lng)) + 
        sin(radians(user_lat)) * sin(radians(COALESCE(p.latitude, 0)))
      ), 2
    )::NUMERIC(10, 2) as distance_km
  FROM profiles p
  WHERE 
    p.roles && ARRAY['fourmiz']
    AND COALESCE(p.is_available, false) = true
    AND p.latitude IS NOT NULL 
    AND p.longitude IS NOT NULL
    AND p.latitude != 0
    AND p.longitude != 0
    AND (service_category_id IS NULL OR p.service_category_id = get_nearby_fourmiz.service_category_id)
    AND (
      6371 * acos(
        cos(radians(user_lat)) * cos(radians(p.latitude)) * 
        cos(radians(p.longitude) - radians(user_lng)) + 
        sin(radians(user_lat)) * sin(radians(p.latitude))
      ) <= radius_km
    )
  ORDER BY distance_km
  LIMIT 50;
END;
$$;


--
-- TOC entry 765 (class 1255 OID 76493)
-- Name: get_real_user_ids_simple(integer); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.get_real_user_ids_simple(limit_count integer DEFAULT 5) RETURNS TABLE(user_id uuid, user_info text)
    LANGUAGE plpgsql
    AS $$
BEGIN
  -- Essayer 'users' en premier (le plus courant)
  BEGIN
    RETURN QUERY
    SELECT 
      u.id,
      COALESCE(u.email, 'User-' || u.id::text)
    FROM users u
    LIMIT limit_count;
    
    IF FOUND THEN RETURN; END IF;
  EXCEPTION
    WHEN undefined_table THEN NULL;
    WHEN undefined_column THEN 
      -- Si pas de colonne email, utiliser juste l'ID
      RETURN QUERY
      SELECT 
        u.id,
        'User-' || u.id::text
      FROM users u
      LIMIT limit_count;
      
      IF FOUND THEN RETURN; END IF;
  END;
  
  -- Essayer 'profiles'
  BEGIN
    RETURN QUERY
    SELECT 
      p.id,
      COALESCE(p.email, 'Profile-' || p.id::text)
    FROM profiles p
    LIMIT limit_count;
    
    IF FOUND THEN RETURN; END IF;
  EXCEPTION
    WHEN undefined_table THEN NULL;
    WHEN undefined_column THEN
      RETURN QUERY
      SELECT 
        p.id,
        'Profile-' || p.id::text
      FROM profiles p
      LIMIT limit_count;
      
      IF FOUND THEN RETURN; END IF;
  END;
  
  -- Si rien ne marche, retourner vide
  RETURN;
END;
$$;


--
-- TOC entry 724 (class 1255 OID 53204)
-- Name: get_recommended_price(integer, character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.get_recommended_price(p_service_id integer, p_urgency_level character varying DEFAULT 'normal'::character varying) RETURNS json
    LANGUAGE plpgsql
    AS $$
DECLARE
  base_price DECIMAL(10,2);
  urgency_multiplier DECIMAL(3,2);
  recommended_price DECIMAL(10,2);
  result JSON;
BEGIN
  SELECT 
    CASE 
      WHEN LOWER(categorie) LIKE '%jardinage%' THEN 25.00
      WHEN LOWER(categorie) LIKE '%ménage%' THEN 20.00
      WHEN LOWER(categorie) LIKE '%informatique%' THEN 40.00
      WHEN LOWER(categorie) LIKE '%transport%' THEN 15.00
      WHEN LOWER(categorie) LIKE '%administratif%' THEN 30.00
      WHEN LOWER(categorie) LIKE '%bricolage%' THEN 35.00
      WHEN LOWER(categorie) LIKE '%cuisine%' THEN 45.00
      ELSE 25.00
    END
  FROM services WHERE id = p_service_id INTO base_price;

  urgency_multiplier := CASE p_urgency_level
    WHEN '30min' THEN 2.0
    WHEN '1hour' THEN 1.5
    WHEN '2hours' THEN 1.3
    ELSE 1.0
  END;

  recommended_price := base_price * urgency_multiplier;

  result := json_build_object(
    'base_price', base_price,
    'urgency_multiplier', urgency_multiplier,
    'recommended_price', recommended_price,
    'urgency_surcharge', (recommended_price - base_price)
  );

  RETURN result;
END;
$$;


