-- Name: get_service_categories(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.get_service_categories() RETURNS TABLE(id text, name text, icon text, color text, sort_order integer)
    LANGUAGE sql
    AS $$
    WITH category_data AS (
        SELECT 
            c.id,
            c.name,
            c.color,
            COUNT(p.id) as fourmiz_count
        FROM categories c
        LEFT JOIN profiles p ON p.service_category_id = c.id 
            AND p.roles && ARRAY['fourmiz'] 
            AND p.is_available = true
        GROUP BY c.id, c.name, c.color
    )
    SELECT 
        'all' as id,
        'Tous' as name,
        'apps' as icon,
        '#000000' as color,
        0 as sort_order
    
    UNION ALL
    
    SELECT 
        c.id::text as id,
        c.name,
        'bug' as icon,  -- Icône fourmi pour toutes les catégories
        CASE 
            WHEN c.name ILIKE '%formation%' OR c.name ILIKE '%coaching%' THEN '#4CAF50'
            WHEN c.name ILIKE '%dépannage%' OR c.name ILIKE '%réparation%' THEN '#FF9800'
            WHEN c.name ILIKE '%mécanique%' THEN '#9C27B0'
            WHEN c.name ILIKE '%électricité%' THEN '#FFC107'
            WHEN c.name ILIKE '%jardinage%' OR c.name ILIKE '%agriculture%' THEN '#8BC34A'
            WHEN c.name ILIKE '%bâtiment%' THEN '#607D8B'
            WHEN c.name ILIKE '%sécurité%' THEN '#F44336'
            WHEN c.name ILIKE '%transport%' OR c.name ILIKE '%livraison%' THEN '#FF5722'
            WHEN c.name ILIKE '%nettoyage%' THEN '#2196F3'
            WHEN c.name ILIKE '%restauration%' OR c.name ILIKE '%bar%' THEN '#795548'
            WHEN c.name ILIKE '%enfance%' OR c.name ILIKE '%famille%' THEN '#E91E63'
            WHEN c.name ILIKE '%senior%' OR c.name ILIKE '%aide%' THEN '#FF4081'
            WHEN c.name ILIKE '%art%' OR c.name ILIKE '%culture%' THEN '#673AB7'
            WHEN c.name ILIKE '%événementiel%' THEN '#3F51B5'
            WHEN c.name ILIKE '%informatique%' THEN '#2196F3'
            WHEN c.name ILIKE '%administratif%' OR c.name ILIKE '%secrétariat%' THEN '#424242'
            WHEN c.name ILIKE '%bien-être%' THEN '#FF4081'
            WHEN c.name ILIKE '%animaux%' THEN '#4CAF50'
            -- Couleur basée sur la couleur existante de la catégorie si elle existe
            WHEN c.color IS NOT NULL AND c.color != '' THEN c.color
            ELSE '#757575'
        END as color,
        ROW_NUMBER() OVER (ORDER BY fourmiz_count DESC) as sort_order
    FROM category_data c
    WHERE c.fourmiz_count > 0
    ORDER BY sort_order;
$$;


