--
-- TOC entry 709 (class 1255 OID 81122)
-- Name: get_user_display_name(uuid); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.get_user_display_name(target_user_id uuid) RETURNS text
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
  profile_firstname TEXT;
  profile_lastname TEXT;
  profile_email TEXT;
  user_meta JSON;
  auth_email TEXT;
  display_name TEXT;
  email_part TEXT;
BEGIN
  -- 1. Récupérer depuis la table profiles (structure connue)
  SELECT firstname, lastname, email
  INTO profile_firstname, profile_lastname, profile_email
  FROM profiles
  WHERE user_id = target_user_id;
  
  -- Construire depuis le profil
  IF profile_firstname IS NOT NULL AND profile_lastname IS NOT NULL 
     AND trim(profile_firstname) <> '' AND trim(profile_lastname) <> '' THEN
    RETURN trim(profile_firstname) || ' ' || trim(profile_lastname);
  END IF;
  
  -- Prénom seul depuis profil
  IF profile_firstname IS NOT NULL AND trim(profile_firstname) <> '' THEN
    RETURN trim(profile_firstname);
  END IF;
  
  -- Nom seul depuis profil
  IF profile_lastname IS NOT NULL AND trim(profile_lastname) <> '' THEN
    RETURN trim(profile_lastname);
  END IF;
  
  -- 2. Fallback: métadonnées depuis auth.users
  SELECT user_metadata, email
  INTO user_meta, auth_email
  FROM auth.users
  WHERE id = target_user_id;
  
  IF user_meta IS NOT NULL THEN
    -- Prénom + nom depuis métadonnées
    IF user_meta->>'firstname' IS NOT NULL AND user_meta->>'lastname' IS NOT NULL 
       AND trim(user_meta->>'firstname') <> '' AND trim(user_meta->>'lastname') <> '' THEN
      RETURN trim(user_meta->>'firstname') || ' ' || trim(user_meta->>'lastname');
    END IF;
    
    -- Prénom seul depuis métadonnées
    IF user_meta->>'firstname' IS NOT NULL AND trim(user_meta->>'firstname') <> '' THEN
      RETURN trim(user_meta->>'firstname');
    END IF;
    
    -- Nom seul depuis métadonnées
    IF user_meta->>'lastname' IS NOT NULL AND trim(user_meta->>'lastname') <> '' THEN
      RETURN trim(user_meta->>'lastname');
    END IF;
  END IF;
  
  -- 3. Extraire depuis l'email (profil ou auth)
  email_part := COALESCE(profile_email, auth_email);
  
  IF email_part IS NOT NULL AND email_part LIKE '%@%' THEN
    -- Prendre la partie avant @
    email_part := split_part(email_part, '@', 1);
    
    -- Nettoyer (remplacer . _ - par espaces)
    email_part := replace(replace(replace(email_part, '.', ' '), '_', ' '), '-', ' ');
    
    -- Capitaliser chaque mot
    SELECT string_agg(initcap(word), ' ')
    INTO display_name
    FROM unnest(string_to_array(email_part, ' ')) AS word
    WHERE trim(word) <> '';
    
    IF display_name IS NOT NULL AND trim(display_name) <> '' THEN
      RETURN trim(display_name);
    END IF;
  END IF;
  
  -- Fallback final
  RETURN 'Utilisateur';
END;
$$;


--
-- TOC entry 769 (class 1255 OID 81264)
-- Name: get_user_display_name_from_profiles(uuid); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.get_user_display_name_from_profiles(target_user_id uuid) RETURNS text
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
  profile_firstname TEXT;
  profile_lastname TEXT;
  profile_email TEXT;
  display_name TEXT;
  email_part TEXT;
BEGIN
  -- Récupérer depuis la table profiles uniquement
  SELECT firstname, lastname, email
  INTO profile_firstname, profile_lastname, profile_email
  FROM profiles
  WHERE user_id = target_user_id;
  
  -- Si aucun profil trouvé
  IF NOT FOUND THEN
    RETURN 'Utilisateur';
  END IF;
  
  -- Construire le nom depuis le profil
  IF profile_firstname IS NOT NULL AND profile_lastname IS NOT NULL 
     AND trim(profile_firstname) <> '' AND trim(profile_lastname) <> '' THEN
    RETURN trim(profile_firstname) || ' ' || trim(profile_lastname);
  END IF;
  
  -- Prénom seul
  IF profile_firstname IS NOT NULL AND trim(profile_firstname) <> '' THEN
    RETURN trim(profile_firstname);
  END IF;
  
  -- Nom seul
  IF profile_lastname IS NOT NULL AND trim(profile_lastname) <> '' THEN
    RETURN trim(profile_lastname);
  END IF;
  
  -- Fallback: extraire depuis l'email du profil
  IF profile_email IS NOT NULL AND profile_email LIKE '%@%' THEN
    email_part := split_part(profile_email, '@', 1);
    email_part := replace(replace(replace(email_part, '.', ' '), '_', ' '), '-', ' ');
    
    SELECT string_agg(initcap(word), ' ')
    INTO display_name
    FROM unnest(string_to_array(trim(email_part), ' ')) AS word
    WHERE trim(word) <> '';
    
    IF display_name IS NOT NULL AND trim(display_name) <> '' THEN
      RETURN trim(display_name);
    END IF;
  END IF;
  
  -- Fallback final
  RETURN 'Utilisateur';
END;
$$;


