--
-- TOC entry 654 (class 1255 OID 67836)
-- Name: get_user_referral_earnings(uuid); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.get_user_referral_earnings(input_user_id uuid) RETURNS TABLE(total_referred integer, active_referrals integer, total_earnings numeric, this_month_earnings numeric, pending_commissions numeric)
    LANGUAGE plpgsql
    AS $$
BEGIN
  RETURN QUERY
  SELECT 
    COUNT(ur.id)::INTEGER as total_referred,
    COUNT(CASE WHEN ur.status = 'active' THEN 1 END)::INTEGER as active_referrals,
    COALESCE(SUM(ur.bonus_earned + ur.total_commission_earned), 0) as total_earnings,
    COALESCE(SUM(
      CASE 
        WHEN ur.created_at >= date_trunc('month', CURRENT_DATE) 
        THEN ur.bonus_earned + ur.total_commission_earned 
        ELSE 0 
      END
    ), 0) as this_month_earnings,
    COALESCE((
      SELECT SUM(rc.amount) 
      FROM referral_commissions rc 
      JOIN user_referrals ur2 ON ur2.id = rc.referral_id 
      WHERE ur2.referrer_user_id = input_user_id 
      AND rc.status = 'pending'
    ), 0) as pending_commissions
  FROM user_referrals ur
  WHERE ur.referrer_user_id = input_user_id;
END;
$$;


