--
-- TOC entry 679 (class 1255 OID 136948)
-- Name: handle_first_mission_referral(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.handle_first_mission_referral() RETURNS trigger
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
  referral_record RECORD;
  bonus_amount DECIMAL(10,2) := 50;
  commission_rate DECIMAL(5,2) := 3;  -- Taux fourmiz
  commission_amount DECIMAL(10,2);
  mission_amount DECIMAL(10,2);
BEGIN
  -- Seulement si la mission passe à "completed"
  IF NEW.status = 'completed' AND (OLD.status IS NULL OR OLD.status != 'completed') THEN
    
    SELECT ur.* INTO referral_record
    FROM user_referrals ur
    WHERE ur.referred_user_id = NEW.fourmiz_id 
      AND ur.first_order_completed = false;
    
    IF FOUND THEN
      mission_amount := COALESCE(NEW.proposed_amount::DECIMAL, 0);
      commission_amount := mission_amount * (commission_rate / 100);
      
      UPDATE user_referrals 
      SET 
        first_order_completed = true,
        first_order_date = NOW(),
        status = 'active',
        bonus_earned = bonus_amount,
        total_commission_earned = commission_amount,
