CREATE FUNCTION public.handle_first_order_referral() RETURNS trigger
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
  referral_record RECORD;
  bonus_amount DECIMAL(10,2) := 50;
  commission_rate DECIMAL(5,2) := 5;
  commission_amount DECIMAL(10,2);
  order_amount DECIMAL(10,2);
BEGIN
  -- Récupérer paramètres
  SELECT COALESCE(setting_value::DECIMAL, 50) INTO bonus_amount
  FROM admin_settings WHERE setting_key = 'referral_bonus_amount';
  
  SELECT COALESCE(setting_value::DECIMAL, 5) INTO commission_rate
  FROM admin_settings WHERE setting_key = 'referral_client_commission_rate';
  
  order_amount := COALESCE(NEW.proposed_amount::DECIMAL, 0);
  commission_amount := order_amount * (commission_rate / 100);
  
  SELECT ur.* INTO referral_record
  FROM user_referrals ur
  WHERE ur.referred_user_id = NEW.client_id 
    AND ur.first_order_completed = false;
  
  IF FOUND THEN
    UPDATE user_referrals 
    SET 
      first_order_completed = true,
      first_order_date = NOW(),
      status = 'active',
      bonus_earned = bonus_amount,
      total_commission_earned = commission_amount,
      updated_at = NOW()
    WHERE id = referral_record.id;
  END IF;
  
  RETURN NEW;
EXCEPTION WHEN OTHERS THEN
  RAISE LOG 'Erreur handle_first_order_referral: %', SQLERRM;
  RETURN NEW;
END;
$$;


