--
-- TOC entry 616 (class 1255 OID 76870)
-- Name: migrate_existing_users_roles(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.migrate_existing_users_roles() RETURNS TABLE(user_id uuid, old_roles text[], new_roles text[], migration_status text)
    LANGUAGE plpgsql
    AS $$
DECLARE
  user_record record;
  new_user_roles text[];
  migration_result text;
BEGIN
  FOR user_record IN 
    SELECT id, roles, email, first_name, last_name 
    FROM profiles 
    WHERE roles IS NULL OR roles = ARRAY['user']::text[] OR 'user' = ANY(roles)
  LOOP
    new_user_roles := ARRAY['client']::text[];
    migration_result := 'Migré vers client par défaut';
    
    IF EXISTS(SELECT 1 FROM services WHERE user_id = user_record.id) THEN
      new_user_roles := ARRAY['fourmiz']::text[];
      migration_result := 'Migré vers fourmiz (a des services)';
    END IF;
    
    IF EXISTS(SELECT 1 FROM orders WHERE client_id = user_record.id) THEN
      IF 'fourmiz' = ANY(new_user_roles) THEN
        new_user_roles := ARRAY['client', 'fourmiz']::text[];
        migration_result := 'Migré vers profil hybride (commandes + services)';
      ELSE
        new_user_roles := ARRAY['client']::text[];
        migration_result := 'Migré vers client (a des commandes)';
      END IF;
    END IF;
    
    UPDATE profiles 
    SET roles = new_user_roles, updated_at = now()
    WHERE id = user_record.id;
    
    RETURN QUERY SELECT 
      user_record.id,
      user_record.roles,
      new_user_roles,
      migration_result;
  END LOOP;
END;
$$;


