--
-- TOC entry 688 (class 1255 OID 138342)
-- Name: process_referral_for_order(bigint); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.process_referral_for_order(order_id_input bigint) RETURNS TABLE(success boolean, message text)
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
  order_record RECORD;
  referral_record RECORD;
  bonus_amount DECIMAL(10,2) := 50;
  commission_rate DECIMAL(5,2) := 5;
  commission_amount DECIMAL(10,2);
BEGIN
  SELECT * INTO order_record FROM orders WHERE id = order_id_input;
  
  IF NOT FOUND THEN
    RETURN QUERY SELECT FALSE, 'Commande non trouvée';
    RETURN;
  END IF;
  
  SELECT ur.* INTO referral_record
  FROM user_referrals ur
  WHERE ur.referred_user_id = order_record.client_id 
    AND ur.first_order_completed = false;
  
  IF FOUND THEN
    commission_amount := order_record.proposed_amount * (commission_rate / 100);
    
    UPDATE user_referrals 
    SET 
      first_order_completed = true,
      first_order_date = NOW(),
      status = 'active',
      bonus_earned = bonus_amount,
      total_commission_earned = commission_amount,
      updated_at = NOW()
    WHERE id = referral_record.id;
    
    RETURN QUERY SELECT TRUE, format('Parrainage activé - Bonus: %s, Commission: %s', bonus_amount, commission_amount);
  ELSE
    RETURN QUERY SELECT FALSE, 'Aucun parrainage pending trouvé';
  END IF;
END;
$$;


