  code_valid BOOLEAN;
BEGIN
  SELECT referrer_user_id, code_exists AND is_active
  INTO referrer_id, code_valid
  FROM check_referral_code(referral_code_input);
  
  IF code_valid AND referrer_id IS NOT NULL AND referrer_id != new_user_id THEN
    INSERT INTO user_referrals (
      referrer_user_id,
      referred_user_id,
      referral_code,
      status,
      created_at
    ) VALUES (
      referrer_id,
      new_user_id,
      referral_code_input,
      'pending',
      NOW()
    );
    
    RETURN true;
  END IF;
  
  RETURN false;
END;
$$;


