--
-- TOC entry 533 (class 1255 OID 59938)
-- Name: search_fourmiz_simple(text[], integer, numeric, integer); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.search_fourmiz_simple(p_categories text[] DEFAULT NULL::text[], p_rayon_max integer DEFAULT 50, p_prix_max numeric DEFAULT 1000, p_limit integer DEFAULT 20) RETURNS TABLE(user_id uuid, score integer, prix_minimum_heure numeric, rayon_deplacement_km integer, nb_categories integer)
    LANGUAGE plpgsql
    AS $$
BEGIN
  RETURN QUERY
  SELECT 
    fc.user_id,
    (
      CASE WHEN fc.is_available THEN 10 ELSE 0 END +
      CASE WHEN p_categories IS NOT NULL AND fc.categories_completes && p_categories THEN 20 ELSE 0 END +
      CASE WHEN fc.profil_complet_pourcent >= 80 THEN 5 ELSE 0 END
    ) as score,
    fc.prix_minimum_heure,
    fc.rayon_deplacement_km,
    array_length(fc.categories_completes, 1) as nb_categories
  FROM public.fourmiz_criteria fc
  WHERE fc.is_active = true
    AND (p_rayon_max IS NULL OR fc.rayon_deplacement_km <= p_rayon_max)
    AND (p_prix_max IS NULL OR fc.prix_minimum_heure <= p_prix_max)
    AND (p_categories IS NULL OR fc.categories_completes && p_categories)
  ORDER BY score DESC, fc.profil_complet_pourcent DESC
  LIMIT p_limit;
END;
$$;


