    LANGUAGE plpgsql
    AS $$
BEGIN
  IF (TG_OP = 'INSERT') THEN
    IF NEW.slug IS NULL OR NEW.slug = '' THEN
      NEW.slug := generate_unique_slug(NEW.title);
    END IF;

  ELSIF (TG_OP = 'UPDATE') THEN
    IF (NEW.title IS DISTINCT FROM OLD.title) AND (NEW.slug IS NULL OR NEW.slug = '' OR NEW.slug = generate_unique_slug(OLD.title)) THEN
      NEW.slug := generate_unique_slug(NEW.title);
    END IF;
  END IF;

  RETURN NEW;
END;
$$;


--
-- TOC entry 593 (class 1255 OID 55242)
-- Name: should_send_notification(uuid, character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.should_send_notification(p_user_id uuid, p_notification_type character varying) RETURNS boolean
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
    preferences RECORD;
    user_current_time TIME;
BEGIN
    -- Obtenir les préférences de l'utilisateur
    SELECT * INTO preferences
    FROM notification_preferences
    WHERE user_id = p_user_id;
    
    -- Si pas de préférences, utiliser les valeurs par défaut
    IF NOT FOUND THEN
        RETURN CASE 
            WHEN p_notification_type IN ('chat_messages', 'order_updates', 'system_alerts') THEN true
            ELSE false
        END;
    END IF;
    
    -- Vérifier si les notifications push sont activées
    IF NOT preferences.push_enabled THEN
        RETURN false;
    END IF;
    
    -- Vérifier le type de notification
    CASE p_notification_type
        WHEN 'chat_messages' THEN
            IF NOT preferences.chat_messages THEN RETURN false; END IF;
        WHEN 'order_updates' THEN
            IF NOT preferences.order_updates THEN RETURN false; END IF;
        WHEN 'system_alerts' THEN
            IF NOT preferences.system_alerts THEN RETURN false; END IF;
        WHEN 'marketing' THEN
            IF NOT preferences.marketing THEN RETURN false; END IF;
        ELSE
            RETURN false;
    END CASE;
    
    -- Vérifier les heures de silence
    IF preferences.quiet_hours_start IS NOT NULL AND preferences.quiet_hours_end IS NOT NULL THEN
        user_current_time := (NOW() AT TIME ZONE COALESCE(preferences.timezone, 'Europe/Paris'))::TIME;
        
        IF preferences.quiet_hours_start <= preferences.quiet_hours_end THEN
            IF user_current_time BETWEEN preferences.quiet_hours_start AND preferences.quiet_hours_end THEN
                RETURN false;
            END IF;
        ELSE
            IF user_current_time >= preferences.quiet_hours_start OR user_current_time <= preferences.quiet_hours_end THEN
                RETURN false;
            END IF;
        END IF;
    END IF;
    
    RETURN true;
END;
$$;


