--
-- TOC entry 658 (class 1255 OID 153090)
-- Name: sync_referral_code_to_profiles(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.sync_referral_code_to_profiles() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
  -- Lors d'un INSERT (nouveau code créé)
  IF TG_OP = 'INSERT' AND NEW.is_active = true THEN
    UPDATE profiles 
    SET referral_code = NEW.code
    WHERE user_id = NEW.user_id;
    
    RAISE NOTICE 'Code % synchronisé pour user %', NEW.code, NEW.user_id;
  END IF;
  
  -- Lors d'un UPDATE (code modifié)
  IF TG_OP = 'UPDATE' THEN
    -- Si le code devient actif
    IF NEW.is_active = true AND OLD.is_active = false THEN
      UPDATE profiles 
      SET referral_code = NEW.code
      WHERE user_id = NEW.user_id;
      
      RAISE NOTICE 'Code % réactivé pour user %', NEW.code, NEW.user_id;
    
    -- Si le code devient inactif
    ELSIF NEW.is_active = false AND OLD.is_active = true THEN
      UPDATE profiles 
      SET referral_code = NULL
      WHERE user_id = NEW.user_id AND referral_code = OLD.code;
      
      RAISE NOTICE 'Code % désactivé pour user %', OLD.code, NEW.user_id;
    
    -- Si le code change (rare mais possible)
    ELSIF NEW.code != OLD.code AND NEW.is_active = true THEN
      UPDATE profiles 
      SET referral_code = NEW.code
      WHERE user_id = NEW.user_id;
      
      RAISE NOTICE 'Code changé de % à % pour user %', OLD.code, NEW.code, NEW.user_id;
    END IF;
  END IF;
  
  RETURN COALESCE(NEW, OLD);
END;
$$;


