    ELSE
        result := result || '❌ Colonne services.workflow_type manquante. ';
    END IF;
    
    -- Vérifier les nouvelles tables
    IF EXISTS (SELECT 1 FROM information_schema.tables 
               WHERE table_name = 'order_applications') THEN
        result := result || '✅ Table order_applications créée. ';
    ELSE
        result := result || '❌ Table order_applications manquante. ';
    END IF;
    
    IF EXISTS (SELECT 1 FROM information_schema.tables 
               WHERE table_name = 'pre_selection_chats') THEN
        result := result || '✅ Tables chat pré-sélection créées. ';
    ELSE
        result := result || '❌ Tables chat pré-sélection manquantes. ';
    END IF;
    
    IF EXISTS (SELECT 1 FROM information_schema.columns 
               WHERE table_name = 'profiles' AND column_name = 'bio') THEN
        result := result || '✅ Profils fourmiz enrichis. ';
    ELSE
        result := result || '❌ Profils fourmiz non enrichis. ';
    END IF;
    
