--
-- TOC entry 598 (class 1255 OID 55244)
-- Name: trigger_chat_notification(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.trigger_chat_notification() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
    target_user_id UUID;
    sender_name TEXT;
    order_info RECORD;
    notification_data JSONB;
BEGIN
    IF NEW.message_type = 'system' THEN
        RETURN NEW;
    END IF;
    
    SELECT 
        o.id,
        o.client_id,
        o.fourmiz_id,
        s.title as service_title,
        CASE 
            WHEN NEW.sender_id = o.client_id THEN o.fourmiz_id
            ELSE o.client_id
        END as target_user
    INTO order_info
    FROM orders o
    JOIN services s ON o.service_id = s.id
    WHERE o.id = NEW.order_id;
    
    target_user_id := order_info.target_user;
    
    IF NOT should_send_notification(target_user_id, 'chat_messages') THEN
        RETURN NEW;
    END IF;
    
    SELECT COALESCE(firstname || ' ' || COALESCE(lastname, ''), 'Utilisateur')
    INTO sender_name
    FROM profiles
    WHERE id = NEW.sender_id;
    
    notification_data := json_build_object(
        'type', 'chat_message',
        'orderId', NEW.order_id,
        'messageId', NEW.id,
        'senderId', NEW.sender_id,
        'senderName', sender_name,
        'serviceTitle', order_info.service_title
    );
    
    PERFORM log_notification(
        target_user_id,
        'chat_message',
        sender_name,
        CASE 
            WHEN NEW.message_type = 'location' THEN '📍 A partagé sa position'
            WHEN NEW.message_type = 'image' THEN '📷 A envoyé une image'
            ELSE LEFT(NEW.message, 100)
        END,
        notification_data,
        NEW.order_id,
        NEW.id
    );
    
    PERFORM pg_notify('push_notification', notification_data::text);
    
    RETURN NEW;
END;
$$;


--
-- TOC entry 608 (class 1255 OID 55245)
-- Name: trigger_order_notification(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.trigger_order_notification() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
    notification_title TEXT;
    notification_body TEXT;
    notification_data JSONB;
    target_users UUID[];
BEGIN
    IF OLD.status != NEW.status THEN
        CASE NEW.status
            WHEN 'acceptee' THEN
                notification_title := 'Mission acceptée !';
                notification_body := 'Une fourmiz a accepté votre demande';
                target_users := ARRAY[NEW.client_id];
            WHEN 'en_cours' THEN
                notification_title := 'Mission commencée';
                notification_body := 'La prestation a commencé';
                target_users := ARRAY[NEW.client_id];
            WHEN 'terminee' THEN
                notification_title := 'Mission terminée';
                notification_body := 'La prestation est terminée. N''oubliez pas de laisser un avis !';
                target_users := ARRAY[NEW.client_id];
            WHEN 'annulee' THEN
                notification_title := 'Mission annulée';
                notification_body := 'La mission a été annulée';
                target_users := ARRAY[NEW.client_id, NEW.fourmiz_id];
            ELSE
                RETURN NEW;
        END CASE;
        
        notification_data := json_build_object(
            'type', 'order_update',
            'orderId', NEW.id,
            'oldStatus', OLD.status,
            'newStatus', NEW.status
        );
        
        FOR i IN 1..array_length(target_users, 1) LOOP
            IF target_users[i] IS NOT NULL AND should_send_notification(target_users[i], 'order_updates') THEN
                PERFORM log_notification(
                    target_users[i],
                    'order_update',
                    notification_title,
                    notification_body,
                    notification_data,
                    NEW.id
                );
                
                -- ✅ CORRECTION ICI : Cast explicite en JSONB
                PERFORM pg_notify('push_notification', (notification_data || json_build_object('targetUserId', target_users[i])::jsonb)::text);
            END IF;
        END LOOP;
    END IF;
    
    RETURN NEW;
END;
$$;


--
-- TOC entry 531 (class 1255 OID 123281)
-- Name: trigger_update_profile_counters(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.trigger_update_profile_counters() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
  affected_users UUID[] := '{}';
BEGIN
  -- Déterminer quels utilisateurs sont affectés selon le type d'opération
  
  IF TG_OP = 'INSERT' THEN
    -- Nouvelle commande créée
    IF NEW.client_id IS NOT NULL THEN
      affected_users := affected_users || NEW.client_id;
    END IF;
    IF NEW.fourmiz_id IS NOT NULL THEN
      affected_users := affected_users || NEW.fourmiz_id;
    END IF;
    
  ELSIF TG_OP = 'UPDATE' THEN
    -- Commande modifiée - vérifier tous les changements possibles
    
    -- Si client_id a changé
    IF OLD.client_id IS DISTINCT FROM NEW.client_id THEN
      IF OLD.client_id IS NOT NULL THEN
        affected_users := affected_users || OLD.client_id;
      END IF;
      IF NEW.client_id IS NOT NULL THEN
        affected_users := affected_users || NEW.client_id;
      END IF;
    ELSIF NEW.client_id IS NOT NULL THEN
      -- Même client, mais possibles changements de status/rating
      affected_users := affected_users || NEW.client_id;
    END IF;
    
    -- Si fourmiz_id a changé
    IF OLD.fourmiz_id IS DISTINCT FROM NEW.fourmiz_id THEN
      IF OLD.fourmiz_id IS NOT NULL THEN
        affected_users := affected_users || OLD.fourmiz_id;
      END IF;
      IF NEW.fourmiz_id IS NOT NULL THEN
        affected_users := affected_users || NEW.fourmiz_id;
      END IF;
    ELSIF NEW.fourmiz_id IS NOT NULL THEN
      -- Même fourmiz, mais possibles changements de status/rating
      affected_users := affected_users || NEW.fourmiz_id;
    END IF;
    
  ELSIF TG_OP = 'DELETE' THEN
    -- Commande supprimée
    IF OLD.client_id IS NOT NULL THEN
      affected_users := affected_users || OLD.client_id;
    END IF;
    IF OLD.fourmiz_id IS NOT NULL THEN
      affected_users := affected_users || OLD.fourmiz_id;
    END IF;
  END IF;
  
  -- Mettre à jour chaque utilisateur affecté
  DECLARE
    user_id UUID;
  BEGIN
    FOREACH user_id IN ARRAY affected_users
    LOOP
      PERFORM update_profile_counters(user_id);
    END LOOP;
  END;
  
  -- Retourner le bon enregistrement selon le type d'opération
  IF TG_OP = 'DELETE' THEN
    RETURN OLD;
  ELSE
    RETURN NEW;
  END IF;
END;
$$;


