--
-- TOC entry 585 (class 1255 OID 160239)
-- Name: update_gps_position(uuid, numeric, numeric, integer); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.update_gps_position(p_tracking_id uuid, p_latitude numeric, p_longitude numeric, p_accuracy_meters integer DEFAULT NULL::integer) RETURNS boolean
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
  prev_lat DECIMAL(10, 8);
  prev_lon DECIMAL(11, 8);
  distance_moved DECIMAL(8, 3);
  current_route JSONB;
BEGIN
  -- Récupérer la position précédente
  SELECT current_latitude, current_longitude, route_points
  INTO prev_lat, prev_lon, current_route
  FROM active_service_tracking
  WHERE id = p_tracking_id AND status = 'active';
  
  IF NOT FOUND THEN
    RETURN FALSE;
  END IF;
  
  -- Calculer la distance parcourue depuis la dernière mise à jour
  IF prev_lat IS NOT NULL AND prev_lon IS NOT NULL THEN
    distance_moved := (6371 * acos(
      cos(radians(prev_lat)) * 
      cos(radians(p_latitude)) * 
      cos(radians(p_longitude) - radians(prev_lon)) + 
      sin(radians(prev_lat)) * 
      sin(radians(p_latitude))
    ));
  ELSE
    distance_moved := 0;
  END IF;
  
  -- Ajouter le point au parcours (garder max 1000 points)
  current_route := current_route || jsonb_build_object(
    'lat', p_latitude,
    'lng', p_longitude,
    'timestamp', CURRENT_TIMESTAMP,
    'accuracy', p_accuracy_meters
  );
  
  -- Garder seulement les 1000 derniers points
  IF jsonb_array_length(current_route) > 1000 THEN
    current_route := current_route - 0;
  END IF;
  
  -- Mettre à jour la position
  UPDATE active_service_tracking
  SET 
    current_latitude = p_latitude,
    current_longitude = p_longitude,
    last_position_update = CURRENT_TIMESTAMP,
    total_distance_km = total_distance_km + distance_moved,
    route_points = current_route
  WHERE id = p_tracking_id AND status = 'active';
  
  RETURN TRUE;
END;
$$;


--
-- TOC entry 529 (class 1255 OID 160831)
-- Name: update_mission_status(uuid, text, uuid); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.update_mission_status(p_user_id uuid, p_new_status text, p_mission_id uuid DEFAULT NULL::uuid) RETURNS text
    LANGUAGE plpgsql
    AS $$
DECLARE
  v_mission_consent BOOLEAN;
  v_off_duty_consent BOOLEAN;
  v_should_track BOOLEAN;
BEGIN
  -- Récupérer les consentements
  SELECT tracking_consent_mission, tracking_consent_off_duty
  INTO v_mission_consent, v_off_duty_consent
  FROM profiles WHERE user_id = p_user_id;
  
  -- Déterminer si le tracking doit être activé
  v_should_track := CASE 
    WHEN p_new_status IN ('on_mission', 'available') THEN v_mission_consent
    WHEN p_new_status IN ('off_duty', 'break') THEN v_off_duty_consent
    ELSE FALSE
  END;
  
  -- Enregistrer le nouveau statut
  INSERT INTO fourmiz_mission_status (user_id, mission_id, status)
  VALUES (p_user_id, p_mission_id, p_new_status);
  
  -- Mettre à jour le tracking selon les consentements
  UPDATE profiles 
  SET 
    tracking_enabled = v_should_track,
    updated_at = NOW()
  WHERE user_id = p_user_id;
  
  RETURN 'Statut: ' || p_new_status || ' | Tracking: ' || 
    CASE WHEN v_should_track THEN 'ACTIVÉ' ELSE 'DÉSACTIVÉ' END;
END;
$$;


