--
-- TOC entry 736 (class 1255 OID 171128)
-- Name: update_profile_counters(uuid); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.update_profile_counters(profile_user_id uuid) RETURNS void
    LANGUAGE plpgsql
    AS $$
BEGIN
  UPDATE profiles 
  SET 
    -- Compter toutes les commandes du client (inchangé)
    orders_placed = (
      SELECT COALESCE(COUNT(*), 0)
      FROM orders 
      WHERE client_id = profile_user_id
    ),
    
    -- Compter les missions terminées du fourmiz
    missions_completed = (
      SELECT COALESCE(COUNT(*), 0)
      FROM orders 
      WHERE fourmiz_id = profile_user_id 
      AND status = 'terminee'
    ),
    
    -- CORRIGÉ : Rating client basé SEULEMENT sur commandes avec fourmiz assigné
    client_rating = (
      SELECT AVG(fr.rating)
      FROM fourmiz_reviews fr
      JOIN orders o ON fr.order_id = o.id
      WHERE o.client_id = profile_user_id
      AND o.fourmiz_id IS NOT NULL  -- Ajout de cette condition
    ),
    
    -- Client a des vrais avis reçus ? (SEULEMENT commandes avec fourmiz)
    client_has_real_rating = (
      SELECT COUNT(*) > 0
      FROM fourmiz_reviews fr
      JOIN orders o ON fr.order_id = o.id
      WHERE o.client_id = profile_user_id
      AND o.fourmiz_id IS NOT NULL  -- Ajout de cette condition
    ),
    
    -- Rating fourmiz (inchangé)
    fourmiz_rating = (
      SELECT AVG(r.rating)
      FROM ratings r
      JOIN orders o ON r.order_id = o.id
      WHERE o.fourmiz_id = profile_user_id
    ),
    
    -- Fourmiz a des vrais avis reçus ?
    fourmiz_has_real_rating = (
      SELECT COUNT(*) > 0
      FROM ratings r
      JOIN orders o ON r.order_id = o.id
      WHERE o.fourmiz_id = profile_user_id
    )
    
  WHERE user_id = profile_user_id;
END;
$$;


