--
-- TOC entry 638 (class 1255 OID 160722)
-- Name: update_user_location(uuid, numeric, numeric, numeric, numeric, text); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.update_user_location(p_user_id uuid, p_latitude numeric, p_longitude numeric, p_accuracy numeric DEFAULT NULL::numeric, p_speed_kmh numeric DEFAULT NULL::numeric, p_activity_type text DEFAULT 'unknown'::text) RETURNS text
    LANGUAGE plpgsql
    AS $$
DECLARE
  v_movement_status TEXT;
  v_user_exists BOOLEAN;
BEGIN
  -- Vérifier que l'utilisateur existe
  SELECT EXISTS(SELECT 1 FROM profiles WHERE user_id = p_user_id) INTO v_user_exists;
  IF NOT v_user_exists THEN
    RETURN 'ERROR: User not found';
  END IF;
  
  -- Déterminer le statut de mouvement basé sur la vitesse
  IF p_speed_kmh IS NULL OR p_speed_kmh < 1 THEN
    v_movement_status := 'stationary';
  ELSIF p_speed_kmh < 5 THEN
    v_movement_status := 'walking';
  ELSE
    v_movement_status := 'driving';
  END IF;
  
  -- Mettre à jour la position actuelle dans profiles
  UPDATE profiles 
  SET 
    current_latitude = p_latitude,
    current_longitude = p_longitude,
    current_location_updated_at = NOW(),
    location_accuracy = p_accuracy,
    movement_status = v_movement_status,
    speed_kmh = COALESCE(p_speed_kmh, 0),
    updated_at = NOW()
  WHERE user_id = p_user_id;
  
  -- Ajouter à l'historique
  INSERT INTO location_history (
    user_id, latitude, longitude, accuracy, speed_kmh, activity_type
  ) VALUES (
    p_user_id, p_latitude, p_longitude, p_accuracy, p_speed_kmh, p_activity_type
  );
  
  RETURN 'SUCCESS: Location updated';
END;
$$;


--
-- TOC entry 604 (class 1255 OID 170364)
-- Name: update_user_rating(uuid); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.update_user_rating(p_user_id uuid) RETURNS void
    LANGUAGE plpgsql
    AS $$
DECLARE
    avg_client_rating numeric;
    avg_fourmiz_rating numeric;
    client_review_count integer;
    fourmiz_review_count integer;
BEGIN
    -- Calculer les ratings clients (CORRIGÉ : r.rating au lieu de rating)
    SELECT AVG(r.rating), COUNT(*) 
    INTO avg_client_rating, client_review_count
    FROM ratings r
    JOIN orders o ON r.order_id = o.id
    WHERE o.client_id = p_user_id;
    
    -- Calculer les ratings fourmiz (CORRIGÉ : fr.rating au lieu de rating)
    SELECT AVG(fr.rating), COUNT(*) 
    INTO avg_fourmiz_rating, fourmiz_review_count
    FROM fourmiz_reviews fr
    WHERE fr.fourmiz_id = p_user_id;
    
    -- Mettre à jour profiles
    UPDATE profiles 
    SET 
        client_rating = ROUND(COALESCE(avg_client_rating, 5.0), 2),
        client_has_real_rating = (client_review_count > 0),
        fourmiz_rating = ROUND(COALESCE(avg_fourmiz_rating, 5.0), 2),
        fourmiz_has_real_rating = (fourmiz_review_count > 0)
    WHERE user_id = p_user_id;
END;
$$;


