--
-- TOC entry 749 (class 1255 OID 76448)
-- Name: validate_referral_code_safe(character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.validate_referral_code_safe(code_to_check character varying) RETURNS TABLE(is_valid boolean, user_id uuid, user_name text, usage_count integer)
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
BEGIN
  RETURN QUERY
  SELECT 
    (urc.is_active AND 
     (urc.expires_at IS NULL OR urc.expires_at > now()) AND
     (urc.max_usage IS NULL OR urc.usage_count < urc.max_usage)) AS is_valid,
    urc.user_id,
    COALESCE(p.firstname || ' ' || p.lastname, 'Utilisateur') AS user_name,
    urc.usage_count
  FROM user_referral_codes urc
  LEFT JOIN profiles p ON urc.user_id = p.id
  WHERE urc.code = UPPER(code_to_check)
  LIMIT 1;
  
  -- Si aucun résultat, retourner un enregistrement invalide
  IF NOT FOUND THEN
    RETURN QUERY SELECT false, NULL::uuid, 'Code inexistant'::text, 0;
  END IF;
END;
$$;


--
-- TOC entry 739 (class 1255 OID 81265)
-- Name: validate_referral_code_simple(text); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.validate_referral_code_simple(referral_code text) RETURNS json
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
  referral_data RECORD;
  referrer_name TEXT;
  result JSON;
BEGIN
  -- Validation format
  IF referral_code IS NULL OR trim(referral_code) = '' THEN
    RETURN json_build_object(
      'isValid', false,
      'error', 'Code de parrainage requis'
    );
  END IF;
  
  -- Récupérer le code de parrainage
  SELECT *
  INTO referral_data
  FROM user_referral_codes
  WHERE code = upper(trim(referral_code))
    AND is_active = true;
  
  IF NOT FOUND THEN
    RETURN json_build_object(
      'isValid', false,
      'error', 'Code de parrainage invalide ou expiré'
    );
  END IF;
  
  -- Vérifier les limites
  IF referral_data.max_usage IS NOT NULL 
     AND referral_data.usage_count >= referral_data.max_usage THEN
    RETURN json_build_object(
      'isValid', false,
      'error', 'Code de parrainage épuisé'
    );
  END IF;
  
  -- Récupérer le nom depuis profiles seulement
  SELECT get_user_display_name_from_profiles(referral_data.user_id) INTO referrer_name;
  
  -- Construire le résultat
  result := json_build_object(
    'isValid', true,
    'parrainUserId', referral_data.user_id,
    'referrerName', referrer_name,
    'codeInfo', json_build_object(
      'code', referral_data.code,
      'usage_count', referral_data.usage_count,
      'max_usage', referral_data.max_usage
    )
  );
  
  RETURN result;
END;
$$;


--
-- TOC entry 754 (class 1255 OID 76495)
-- Name: validate_referral_code_simple(character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.validate_referral_code_simple(code_to_check character varying) RETURNS TABLE(is_valid boolean, user_id uuid, user_name text, usage_count integer, max_usage integer, expires_at timestamp without time zone)
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
BEGIN
  -- Version simple sans JOIN - juste les données de base
  RETURN QUERY
  SELECT 
    (urc.is_active = true AND 
     (urc.expires_at IS NULL OR urc.expires_at > now()) AND
     (urc.max_usage IS NULL OR urc.usage_count < urc.max_usage)) AS is_valid,
    urc.user_id,
    'Utilisateur'::text AS user_name,  -- Nom générique pour éviter les erreurs
    urc.usage_count,
    urc.max_usage,
    urc.expires_at
  FROM user_referral_codes urc
  WHERE urc.code = UPPER(code_to_check)
  LIMIT 1;
  
  -- Si aucun résultat trouvé
  IF NOT FOUND THEN
    RETURN QUERY SELECT 
      false, 
      NULL::uuid, 
      'Code inexistant'::text, 
      0, 
      NULL::integer,
      NULL::timestamp;
  END IF;
END;
$$;


