--
-- TOC entry 508 (class 1259 OID 160243)
-- Name: active_services_with_position; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW public.active_services_with_position AS
 SELECT t.id AS tracking_id,
    t.service_id,
    t.service_type,
    t.current_latitude,
    t.current_longitude,
    t.last_position_update,
    t.total_distance_km,
    t.status,
    ((pf.firstname || ' '::text) || pf.lastname) AS fourmiz_name,
    pf.avatar_url AS fourmiz_avatar,
    ((pc.firstname || ' '::text) || pc.lastname) AS client_name,
    ((EXTRACT(epoch FROM (CURRENT_TIMESTAMP - t.started_at)))::integer / 60) AS elapsed_minutes,
    ((EXTRACT(epoch FROM (t.estimated_end_at - CURRENT_TIMESTAMP)))::integer / 60) AS remaining_minutes
   FROM ((public.active_service_tracking t
     JOIN public.profiles pf ON ((pf.user_id = t.fourmiz_user_id)))
     JOIN public.profiles pc ON ((pc.user_id = t.client_user_id)))
  WHERE (t.status = ANY (ARRAY['active'::text, 'paused'::text]))
  ORDER BY t.last_position_update DESC;


