-- TOC entry 474 (class 1259 OID 76876)
-- Name: admin_referral_overview; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW public.admin_referral_overview AS
 SELECT ( SELECT count(*) AS count
           FROM public.referrals) AS total_referrals,
    ( SELECT count(*) AS count
           FROM public.referrals
          WHERE (referrals.is_validated = true)) AS active_referrals,
    ( SELECT count(*) AS count
           FROM public.referrals
          WHERE (referrals.created_at >= (CURRENT_DATE - '30 days'::interval))) AS monthly_referrals,
    ( SELECT COALESCE(sum(referral_gains.amount), (0)::numeric) AS "coalesce"
           FROM public.referral_gains
          WHERE (referral_gains.status = 'completed'::text)) AS total_paid_commissions,
    ( SELECT COALESCE(sum(referral_gains.amount), (0)::numeric) AS "coalesce"
           FROM public.referral_gains
          WHERE (referral_gains.status = 'pending'::text)) AS pending_commissions,
    ( SELECT COALESCE(sum(referral_gains.amount), (0)::numeric) AS "coalesce"
           FROM public.referral_gains
          WHERE (referral_gains.created_at >= (CURRENT_DATE - '30 days'::interval))) AS monthly_commissions,
    ( SELECT (public.get_referral_config('referral_system_enabled'::text, (1)::numeric) > (0)::numeric)) AS system_enabled,
