    ( SELECT public.get_referral_config('referral_fourmiz_commission_rate'::text, 3.5) AS get_referral_config) AS current_fourmiz_commission_rate,
    ( SELECT public.get_referral_config('referral_min_order_amount'::text, (20)::numeric) AS get_referral_config) AS current_min_order_amount;


