        END AS status,
    missions_completed,
    COALESCE(fourmiz_rating, default_rating) AS rating
   FROM public.profiles p
  WHERE (('fourmiz'::text = ANY (roles)) AND (tracking_enabled = true))
  ORDER BY current_location_updated_at DESC;


