    year,
    month,
    sum(total_amount) AS role_monthly_total
   FROM ( SELECT unnest(u.roles) AS role,
            EXTRACT(year FROM r.created_at) AS year,
            EXTRACT(month FROM r.created_at) AS month,
            r.amount AS total_amount
           FROM (public.rewards r
             JOIN public.profiles u ON ((u.id = r.user_id)))
          WHERE (r.amount IS NOT NULL)) ur
  GROUP BY role, year, month
  ORDER BY year DESC, month DESC, role;


