-- TOC entry 442 (class 1259 OID 53207)
-- Name: orders_detailed; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW public.orders_detailed AS
 SELECT o.id,
    o.client_id,
    o.service_id,
    o.fourmiz_id,
    o.proposed_amount,
    o.description,
    o.urgency_level,
    o.status,
    o.confirmed_by_fourmiz,
    o.accepted_at,
    o.cancelled_at,
    o.cancelled_by,
    o.rating,
    o.feedback,
    o.invoice_url,
    o.urgency_surcharge,
    o.cancellation_fee,
    o.created_at,
    COALESCE((o.updated_at)::timestamp with time zone, o.created_at) AS updated_at,
    s.title AS service_title,
    s.categorie AS service_category,
    ((pc.firstname || ' '::text) || pc.lastname) AS client_name,
    pc.email AS client_email,
    ((pf.firstname || ' '::text) || pf.lastname) AS fourmiz_name,
    pf.email AS fourmiz_email,
    (EXTRACT(epoch FROM (now() - o.created_at)) / (60)::numeric) AS minutes_since_created,
        CASE o.urgency_level
            WHEN '30min'::text THEN 'Très urgent (30min)'::text
            WHEN '1hour'::text THEN 'Urgent (1h)'::text
            WHEN '2hours'::text THEN 'Assez urgent (2h)'::text
            ELSE 'Normal'::text
        END AS urgency_display
   FROM (((public.orders o
     LEFT JOIN public.services s ON ((o.service_id = s.id)))
     LEFT JOIN public.profiles pc ON ((o.client_id = pc.id)))
     LEFT JOIN public.profiles pf ON ((o.fourmiz_id = pf.id)));


--
-- TOC entry 480 (class 1259 OID 84487)
-- Name: orders_full; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW public.orders_full AS
 SELECT o.id,
    o.user_id,
    o.service_id,
    o.description,
    o.date,
    o.start_time,
    o.end_time,
    o.address,
    o.phone,
    o.urgent,
    o.urgency_level,
    o.invoice_required,
    o.proposed_amount,
    o.status,
    o.created_at,
    o.updated_at,
    o.confirmed_by_fourmiz,
    o.accepted_at,
    o.cancelled_at,
    o.cancelled_by,
    o.rating,
    o.feedback,
    o.invoice_url,
    o.urgency_surcharge,
    o.cancellation_fee,
    o.client_id,
    o.fourmiz_id,
    o.addresses,
    o.postal_code,
    o.city,
    o.departure_address,
    o.arrival_address,
    o.arrival_postal_code,
    o.arrival_city,
    o.delivery_address,
    o.pickup_address,
    o.commission,
    od.alternative_phone,
    od.duration,
    od.equipment,
    od.package_number,
    od.invoice_type,
    od.company_name,
    od.siret,
    od.created_at AS details_created_at,
    od.updated_at AS details_updated_at,
        CASE
            WHEN ((od.duration IS NOT NULL) AND (o.start_time IS NOT NULL)) THEN (o.start_time + ((od.duration || ' minutes'::text))::interval)
            ELSE o.end_time
        END AS calculated_end_time
   FROM (public.orders o
     LEFT JOIN public.order_details od ON ((o.id = od.order_id)));


