-- TOC entry 505 (class 1259 OID 160006)
-- Name: profiles_geolocalized; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW public.profiles_geolocalized AS
 SELECT user_id,
    email,
    firstname,
    lastname,
    address,
    postal_code,
    city,
    latitude,
    longitude,
    formatted_address,
    address_confidence,
    address_validated_at,
    roles,
        CASE
            WHEN (address_confidence >= 0.9) THEN 'high'::text
            WHEN (address_confidence >= 0.7) THEN 'medium'::text
            WHEN (address_confidence >= 0.5) THEN 'low'::text
            ELSE 'very_low'::text
        END AS confidence_level,
        CASE
            WHEN (address_validated_at > (now() - '30 days'::interval)) THEN true
            ELSE false
        END AS recently_validated
   FROM public.profiles
  WHERE ((latitude IS NOT NULL) AND (longitude IS NOT NULL));


