--
-- TOC entry 469 (class 1259 OID 76372)
-- Name: user_earnings_stats; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW public.user_earnings_stats AS
 SELECT sponsor_id AS user_id,
    count(*) AS total_gains,
    sum(amount) AS total_amount,
    sum(
        CASE
            WHEN (status = 'paid'::text) THEN amount
            ELSE (0)::numeric
        END) AS paid_amount,
    sum(
        CASE
            WHEN (status = 'pending'::text) THEN amount
            ELSE (0)::numeric
        END) AS pending_amount,
    sum(
        CASE
            WHEN (type = ANY (ARRAY['bonus'::text, 'signup_bonus'::text, 'first_order_bonus'::text, 'manual_bonus'::text])) THEN amount
            ELSE (0)::numeric
        END) AS bonus_amount,
    sum(
        CASE
            WHEN (type = ANY (ARRAY['commission'::text, 'client_order'::text, 'fourmiz_service'::text, 'fourmiz_client'::text])) THEN amount
            ELSE (0)::numeric
        END) AS commission_amount,
    count(
        CASE
            WHEN (created_at >= (now() - '30 days'::interval)) THEN 1
            ELSE NULL::integer
        END) AS gains_last_month
   FROM public.referral_gains
  WHERE (status <> 'cancelled'::text)
  GROUP BY sponsor_id;


