-- TOC entry 477 (class 1259 OID 83036)
-- Name: user_revenue_summary; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW public.user_revenue_summary AS
 SELECT p.id AS user_id,
    p.firstname,
    p.lastname,
    COALESCE(b.total_rewards, (0)::numeric) AS total_badges_rewards,
    COALESCE(rg.total_bonus, (0)::numeric) AS total_referral_bonus,
    COALESCE(rc.total_commission, (0)::numeric) AS total_referral_commissions,
    COALESCE(sg.total_service_commission, (0)::numeric) AS total_service_commissions,
    (((COALESCE(b.total_rewards, (0)::numeric) + COALESCE(rg.total_bonus, (0)::numeric)) + COALESCE(rc.total_commission, (0)::numeric)) + COALESCE(sg.total_service_commission, (0)::numeric)) AS revenus_total
   FROM ((((public.profiles p
     LEFT JOIN ( SELECT rewards.user_id,
            sum(rewards.amount) AS total_rewards
           FROM public.rewards
          GROUP BY rewards.user_id) b ON ((b.user_id = p.id)))
     LEFT JOIN ( SELECT referrals.parrain_id,
            sum(referrals.bonus_amount) AS total_bonus
           FROM public.referrals
          WHERE (referrals.is_validated = true)
          GROUP BY referrals.parrain_id) rg ON ((rg.parrain_id = p.id)))
     LEFT JOIN ( SELECT referral_commissions.parrain_id,
            sum(referral_commissions.commission_amount) AS total_commission
           FROM public.referral_commissions
          GROUP BY referral_commissions.parrain_id) rc ON ((rc.parrain_id = p.id)))
     LEFT JOIN ( SELECT user_credits.user_id,
            sum((user_credits.amount)::numeric) AS total_service_commission
           FROM public.user_credits
          WHERE (user_credits.type = 'commission_fournisseur'::text)
          GROUP BY user_credits.user_id) sg ON ((sg.user_id = p.id)));


